: 1000\n# 异步线程配置\nasync:\n  executor:\n    thread:\n      # 核心线程数\n      corePoolSize: 10\n      # 最大线程数\n      maxPoolSize: 20\n      # 任务队列大小\n      queueCapacity: 1000\n      # 缓冲队列中线程的空闲时间\n      keepAliveSeconds: 300\n# MinIO\nminio:\n  #对象存储服务的URL\n  url: http://1.13.21.54:9000\n  #账户\n  accessKey: ydsz\n  #密码\n  secretKey: ydsz1020\n  #存储桶\n  bucketName: tdcd-local\n# SAP RFC配置\n# jco:\n#   client:\n#     # SAP服务器\n#     ashost: 1.13.24.182\n#     # SAP系统编号\n#     sysnr: 00\n#     # SAP集团\n#     client: 100\n#     # SAP用户\n#     user:   ST01_ADMIN\n#     # SAP密码\n#     passwd: startdis2022\n#     # SAP语言\n#     lang: EN\n#   destination:\n#     # 最大连接数\n#     peakLimit: 10\n#     # 最大连接线程\n#     poolCapacity: 30\n\n# 拦截器\nsql-intercept:\n  tenant: \n    groupTenant: \n      enable: true\n    companyTenant: \n      enable: true\n  field-fill:\n    createdByIntercept:\n      enable: true\n    updateByIntercept:\n      enable: true\n    createAtIntercept:\n      enable: true\n    updateAtIntercept:\n      enable: true\n\n## 开启店铺id 拦截器\ninterceptor:\n  company:\n    enabled: true\n\n# 开启系统操作日志\nlog:\n  record:\n    enabled: true\n# 日志输出路径配置\nlogback:\n  logDir: /Users/dianjiu/Logs/ydsz/tdcd-cloud/tdcd-sys-web/\n# 定义日志输出级别\nlogging:\n  level:\n    com.scm: info\n    #spring 包日志输出级别\n    org.springframework: info\n    com.alibaba.cloud: info\n    # undertow\n    io.undertow: info\n    # mybatis-plus\n    com.baomidou.mybatisplus: debug\n    com.scm.scheduling.infra.mapper: debug\n\n# flowable 流程定义配置\nflowable:\n  cityProcess:\n    insert.definition: cityProcurementProcess:4:ad6fcbc8-197f-11ee-8a8c-7c214a3c7e54\n  countryProcess:\n    insert.definition: countryProcess:1:0934ccbd-1ef5-11ee-b589-d6d853393802\n# 应用信息\nappInfo:\n  code: pms\n  key: MNiymiv155\n  secret: O8PMelYaH3vnS2JUKe4pXVepUrUcjkiT', '6596423890d64a1e385571a6c424c80f', '2024-08-17 02:50:11', '2024-08-17 02:50:10', 'nacos', '192.168.31.18', 'D', 'uat', '');
INSERT INTO `his_config_info` VALUES (60, 110, 'tdcd-application-local.yaml', 'uat', 'sys', '# 服务端口号\r\nserver:\r\n  # tomcat 配置\r\n  tomcat:\r\n    # tomcat的URI编码\r\n    uri-encoding: UTF-8\r\n    # tomcat最大线程数，默认为200\r\n    max-threads: 500\r\n    # Tomcat启动初始化的线程数，默认值25\r\n    min-spare-threads: 30\r\n\r\n# mybatis-plus\r\nmybatis-plus:\r\n  configuration:\r\n    #控制台打印完整带参数SQL语句\r\n    log-impl: org.apache.ibatis.logging.stdout.StdOutImpl\r\n  #mapper映射文件路径\r\n  mapper-locations: classpath*:/*-infra/src/main/resources/mapper/*.xml,classpath*:/common-log/src/main/resources/mapper/*.xml, classpath*:/mapper/**.xml\r\n\r\n#pagehelper\r\npagehelper:\r\n  # helper-dialect: mysql\r\n  #分页插件会自动检测当前的数据库链接，自动选择合适的分页方式。 你可以配置helperDialect 属性来指定分页插件使用哪种方言。\r\n  auto-runtime-dialect: true\r\n  #分页合理化参数，默认值为 false 。当该参数设置为 true 时， pageNum<=0 时会查询第一页， pageNum>pages （超过总数时），会查询最后一页。\r\n  reasonable: true\r\n  #支持通过Mapper接口参数传递page参数,默认值为false\r\n  support-methods-arguments: true\r\n  #默认值为 false ，当该参数设置为 true 时，如果 pageSize=0 或者 RowBounds.limit =0 就会查询出全部的结果（相当于没有执行分页查询，但是返回结果仍然是 Page 类型）。\r\n  page-size-zero: true\r\n  #为了支持 startPage(Object params) 方法，增加了该参数来配置参数映射，用于从对象中根据属性名取值\r\n  params: count=countSql\r\n\r\n# feign\r\nfeign:\r\n  okhttp:\r\n    enabled: true\r\n  sentinel:\r\n    enabled: true\r\n  client:\r\n    config:\r\n      default:\r\n        connectTimeout: 100000\r\n        readTimeout: 100000\r\n\r\n# knife4j配置\r\nknife4j:\r\n  #启用\r\n  enable: true\r\n  #基础认证\r\n  basic:\r\n    enable: false\r\n    username: startdis\r\n    password: 123456\r\n  #增强配置\r\n  setting:\r\n    enableSwaggerModels: true\r\n    enableDocumentManage: true\r\n    enableHost: false\r\n    enableHostText: http://localhost\r\n    enableRequestCache: true\r\n    enableFilterMultipartApis: false\r\n    enableFilterMultipartApiMethodType: POST\r\n    language: zh-CN\r\n    enableFooter: false\r\n    enableFooterCustom: true\r\n    footerCustomContent: Copyright © 2021 Startdis All Rights Reserved\r\n\r\n# 定义日志类型\r\nlogback:\r\n  fileType: log\r\n\r\nspring:\r\n    # 循环依赖的问题\r\n  main:\r\n    allow-circular-references: true\r\n  # MVC默认的路径匹配策略为PATH_PATTERN_PARSER，需要修改为ANT_PATH_MATCHER 解决swagger兼容性问题\r\n  mvc:\r\n    pathmatch:\r\n      matching-strategy: ANT_PATH_MATCHER', 'd37b051d1870895f0cb68e3d1167ba33', '2024-08-17 02:50:11', '2024-08-17 02:50:10', 'nacos', '192.168.31.18', 'D', 'uat', '');
