H_PATTERN_PARSER，需要修改为ANT_PATH_MATCHER 解决swagger兼容性问题\n  mvc:\n    pathmatch:\n      matching-strategy: ANT_PATH_MATCHER', '7c792c66ec95d07f96fe4b02e88c8797', '2024-08-17 02:50:11', '2024-08-17 02:50:10', 'nacos', '192.168.31.18', 'D', 'uat', '');
