INSERT INTO `his_config_info` VALUES (54, 120, 'mogu-admin-sit.yaml', 'sit', '', 'spring:\n  config:\n    activate:\n      on-profile: local\n  servlet:\n    multipart:\n      # 上传文件总的最大值\n      max-request-size: 10MB\n      # 单个文件的最大值\n      max-file-size: 10MB\n  application:\n    name: sdt-sso-web\n  datasource:\n    # mysql\n    url: jdbc:mysql://1.13.21.54:3306/mogu_blog?allowMultiQueries=true&useUnicode=true&characterEncoding=UTF-8&serverTimezone=Asia/Shanghai&useSSL=false&nullCatalogMeansCurrent=true\n    driver-class-name: com.mysql.cj.jdbc.Driver\n    username: root\n    password: ydsz1020\n    # postgresql\n    # url: jdbc:postgresql://1.13.21.54:5432/startdis_saas_sys?allowMultiQueries=true&useUnicode=true&characterEncoding=UTF-8&serverTimezone=Asia/Shanghai&useSSL=false&nullCatalogMeansCurrent=true\n    # driver-class-name: org.postgresql.Driver\n    # username: postgres\n    # password: ydsz1020\n    type: com.alibaba.druid.pool.DruidDataSource\n    # 下面为连接池的补充设置，应用到上面所有数据源中\n    # 初始化大小，最小，最大\n    initial-size: 5\n    min-idle: 5\n    max-active: 20\n    # 配置获取连接等待超时的时间\n    max-wait: 60000\n    # 配置间隔多久才进行一次检测，检测需要关闭的空闲连接，单位是毫秒\n    time-between-eviction-runs-millis: 60000\n    # 配置一个连接在池中最小生存的时间，单位是毫秒\n    min-evictable-idle-time-millis: 300000\n    # mysql\n    # validation-query: SELECT 1 FROM DUAL\n    # postgre\n    validation-query: SELECT 1\n    test-while-idle: true\n    test-on-borrow: false\n    test-on-return: false\n    # 打开PSCache，并且指定每个连接上PSCache的大小\n    pool-prepared-statements: true\n    #   配置监控统计拦截的filters，去掉后监控界面sql无法统计，\'wall\'用于防火墙\n    max-pool-prepared-statement-per-connection-size: 20\n    filters: stat,wall\n    use-global-data-source-stat: true\n    # 通过connectProperties属性来打开mergeSql功能；慢SQL记录\n    connect-properties: druid.stat.mergeSql=true;druid.stat.slowSqlMillis=5000\n  redis:\n    database: 0\n    host: 1.13.21.54\n    password: ydsz1020\n    port: 6379\n    jedis:\n      pool:\n        max-active: 8\n        max-idle: 8\n        min-idle: 0\n        timeout: 1000\n# 异步线程配置\nasync:\n  executor:\n    thread:\n      # 核心线程数\n      corePoolSize: 10\n      # 最大线程数\n      maxPoolSize: 20\n      # 任务队列大小\n      queueCapacity: 1000\n      # 缓冲队列中线程的空闲时间\n      keepAliveSeconds: 300\n# MinIO\nminio:\n  #对象存储服务的URL\n  url: http://1.13.21.54:9000\n  #账户\n  accessKey: ydsz\n  #密码\n  secretKey: ydsz1020\n  #存储桶\n  bucketName: tdcd-local\n\n# 开启系统操作日志\nlog:\n  record:\n    enabled: true\n# 日志输出路径配置\nlogback:\n  logDir: /Users/dianjiu/Logs/ydsz/tdcd-cloud/tdcd-sys-web/\n# 定义日志输出级别\nlogging:\n  level:\n    com.scm: info\n    #spring 包日志输出级别\n    org.springframework: info\n    com.alibaba.cloud: info\n    # undertow\n    io.undertow: info\n    # mybatis-plus\n    com.baomidou.mybatisplus: debug\n    com.scm.scheduling.infra.mapper: debug\n\ntokenHead: blog\n\nisRememberMeExpiresSecond: 30000', 'f2d41915804950507c8fb92a3e9720e4', '2024-08-17 02:50:20', '2024-08-17 02:50:19', 'nacos', '192.168.31.18', 'D', 'sit', '');
INSERT INTO `his_config_info` VALUES (31, 121, 'application-local.yaml', 'demo', 'sys', '# 服务端口号\r\nserver:\r\n  # tomcat 配置\r\n  tomcat:\r\n    # tomcat的URI编码\r\n    uri-encoding: UTF-8\r\n    # tomcat最大线程数，默认为200\r\n    max-threads: 500\r\n    # Tomcat启动初始化的线程数，默认值25\r\n    min-spare-threads: 30\r\n\r\n# mybatis-plus\r\nmybatis-plus:\r\n  configuration:\r\n    #控制台打印完整带参数SQL语句\r\n    log-impl: org.apache.ibatis.logging.stdout.StdOutImpl\r\n  #mapper映射文件路径\r\n  mapper-locations: classpath*:/*-infra/src/main/resources/mapper/*.xml,classpath*:/common-log/src/main/resources/mapper/*.xml, classpath*:/mapper/**.xml\r\n\r\n#pagehelper\r\npagehelper:\r\n  # helper-dialect: mysql\r\n  #分页插件会自动检测当前的数据库链接，自动选择合适的分页方式。 你可以配置helperDialect 属性来指定分页插件使用哪种方言。\r\n  auto-runtime-dialect: true\r\n  #分页合理化参数，默认值为 false 。当该参数设置为 true 时， pageNum<=0 时会查询第一页， pageNum>pages （超过总数时），会查询最后一页。\r\n  reasonable: true\r\n  #支持通过Mapper接口参数传递page参数,默认值为false\r\n  support-methods-arguments: true\r\n  #默认值为 false ，当该参数设置为 true 时，如果 pageSize=0 或者 RowBounds.limit =0 就会查询出全部的结果（相当于没有执行分页查询，但是返回结果仍然是 Page 类型）。\r\n  page-size-zero: true\r\n  #为了支持 startPage(Object params) 方法，增加了该参数来配置参数映射，用于从对象中根据属性名取值\r\n  params: count=countSql\r\n\r\n# feign\r\nfeign:\r\n  okhttp:\r\n    enabled: true\r\n  sentinel:\r\n    enabled: true\r\n  client:\r\n    config:\r\n      default:\r\n        connectTimeout: 100000\r\n        readTimeout: 100000\r\n\r\n# knife4j配置\r\nknife4j:\r\n  #启用\r\n  enable: true\r\n  #基础认证\r\n  basic:\r\n    enable: false\r\n    username: startdis\r\n    password: 123456\r\n  #增强配置\r\n  setting:\r\n    enableSwaggerModels: true\r\n    enableDocumentManage: true\r\n    enableHost: false\r\n    enableHostText: http://localhost\r\n    enableRequestCache: true\r\n    enableFilterMultipartApis: false\r\n    enableFilterMultipartApiMethodType: POST\r\n    language: zh-CN\r\n    enableFooter: false\r\n    enableFooterCustom: true\r\n    footerCustomContent: Copyright © 2021 Startdis All Rights Reserved\r\n\r\n# 定义日志类型\r\nlogback:\r\n  fileType: log\r\n\r\nspring:\r\n    # 循环依赖的问题\r\n  main:\r\n    allow-circular-references: true\r\n  # MVC默认的路径匹配策略为PATH_PATTERN_PARSER，需要修改为ANT_PATH_MATCHER 解决swagger兼容性问题\r\n  mvc:\r\n    pathmatch:\r\n      matching-strategy: ANT_PATH_MATCHER', 'd37b051d1870895f0cb68e3d1167ba33', '2024-08-17 02:51:14', '2024-08-17 02:51:13', 'nacos', '192.168.31.18', 'D', 'local', '');
INSERT INTO `his_config_info` VALUES (32, 122, 'sys-web-local.yaml', 'demo', 'sys', 'spring:\n  config:\n    activate:\n      on-profile: local\n  servlet:\n    multipart:\n      # 上传文件总的最大值\n      max-request-size: 10MB\n      # 单个文件的最大值\n      max-file-size: 10MB\n  datasource:\n    # mysql\n    # url: jdbc:mysql://1.13.24.182:3306/startdis-saas-sys?allowMultiQueries=true&useUnicode=true&characterEncoding=UTF-8&serverTimezone=Asia/Shanghai&useSSL=false&nullCatalogMeansCurrent=true\n    # driver-class-name: com.mysql.cj.jdbc.Driver\n    # username: root\n    # password: 123456\n    # postgresql\n    # url: jdbc:postgresql://1.13.21.54:5432/startdis_saas_sys?allowMultiQueries=true&useUnicode=true&characterEncoding=UTF-8&serverTimezone=Asia/Shanghai&useSSL=false&nullCatalogMeansCurrent=true\n    # driver-class-name: org.postgresql.Driver\n    # username: postgres\n    # password: ydsz1020\n    # type: com.alibaba.druid.pool.DruidDataSource\n    url: jdbc:mysql://1.13.21.54:3306/tdcd?useUnicode=true&characterEncoding=utf-8&useSSL=false&allowMultiQueries=true&serverTimezone=UTC\n    driver-class-name: com.mysql.cj.jdbc.Driver\n    username: root\n    password: ydsz1020\n    type: com.alibaba.druid.pool.DruidDataSource\n    # 下面为连接池的补充设置，应用到上面所有数据源中\n    # 初始化大小，最小，最大\n    initial-size: 5\n    min-idle: 5\n    max-active: 20\n    # 配置获取连接等待超时的时间\n    max-wait: 60000\n    # 配置间隔多久才进行一次检测，检测需要关闭的空闲连接，单位是毫秒\n    time-between-eviction-runs-millis: 60000\n    # 配置一个连接在池中最小生存的时间，单位是毫秒\n    min-evictable-idle-time-millis: 300000\n    # mysql\n    # validation-query: SELECT 1 FROM DUAL\n    # postgre\n    validation-query: SELECT 1\n    test-while-idle: true\n    test-on-borrow: false\n    test-on-return: false\n    # 打开PSCache，并且指定每个连接上PSCache的大小\n    pool-prepared-statements: true\n    #   配置监控统计拦截的filters，去掉后监控界面sql无法统计，\'wall\'用于防火墙\n    max-pool-prepared-statement-per-connection-size: 20\n    filters: stat,wall\n    use-global-data-source-stat: true\n    # 通过connectProperties属性来打开mergeSql功能；慢SQL记录\n    connect-properties: druid.stat.mergeSql=true;druid.stat.slowSqlMillis=5000\n  redis:\n    database: 0\n    host: 1.13.21.54\n    password:\n    port: 6379\n    jedis:\n      pool:\n        max-active: 8\n        max-idle: 8\n        min-idle: 0\n        timeout: 1000\n# 异步线程配置\nasync:\n  executor:\n    thread:\n      # 核心线程数\n      corePoolSize: 10\n      # 最大线程数\n      maxPoolSize: 20\n      # 任务队列大小\n      queueCapacity: 1000\n      # 缓冲队列中线程的空闲时间\n      keepAliveSeconds: 300\n# MinIO\nminio:\n  #对象存储服务的URL\n  url: http://1.13.21.54:9000\n  #账户\n  accessKey: ydsz\n  #密码\n  secretKey: ydsz1020\n  #存储桶\n  bucketName: ydsz-local\n# SAP RFC配置\n# jco:\n#   client:\n#     # SAP服务器\n#     ashost: 1.13.24.182\n#     # SAP系统编号\n#     sysnr: 00\n#     # SAP集团\n#     client: 100\n#     # SAP用户\n#     user:   ST01_ADMIN\n#     # SAP密码\n#     passwd: startdis2022\n#     # SAP语言\n#     lang: EN\n#   destination:\n#     # 最大连接数\n#     peakLimit: 10\n#     # 最大连接线程\n#     poolCapacity: 30\n\n# 拦截器\nsql-intercept:\n  tenant: \n    groupTenant: \n      enable: false\n    companyTenant: \n      enable: false\n  field-fill:\n    createdByIntercept:\n      enable: false\n    updateByIntercept:\n      enable: false\n    createAtIntercept:\n      enable: false\n    updateAtIntercept:\n      enable: false\n\n## 开启店铺id 拦截器\ninterceptor:\n  company:\n    enabled: true\n\n# 开启系统操作日志\nlog:\n  record:\n    enabled: true\n# 日志输出路径配置\nlogback:\n  logDir: /Users/dianjiu/DevLogs/startdis/startdis-saas/sys-web/\n# 定义日志输出级别\nlogging:\n  level:\n    com.scm: info\n    #spring 包日志输出级别\n    org.springframework: info\n    com.alibaba.cloud: info\n    # undertow\n    io.undertow: info\n    # mybatis-plus\n    com.baomidou.mybatisplus: debug\n    com.scm.scheduling.infra.mapper: debug\n', 'ceacc5aced1324bd941c085224cd050d', '2024-08-17 02:51:14', '2024-08-17 02:51:13', 'nacos', '192.168.31.18', 'D', 'local', '');
INSERT INTO `his_config_info` VALUES (33, 123, 'engine-local.yaml', 'engine', 'engine', '# 服务端口号\nserver:\n  # tomcat 配置\n  tomcat:\n    # tomcat的URI编码\n    uri-encoding: UTF-8\n    # tomcat最大线程数，默认为200\n    max-threads: 500\n    # Tomcat启动初始化的线程数，默认值25\n    min-spare-threads: 30\n\n# mybatis-plus\nmybatis-plus:\n  configuration:\n    #控制台打印完整带参数SQL语句\n    log-impl: org.apache.ibatis.logging.stdout.StdOutImpl\n  #mapper映射文件路径\n  mapper-locations: classpath*:/*-infra/src/main/resources/mapper/*.xml,classpath*:/common-log/src/main/resources/mapper/*.xml, classpath*:/mapper/**.xml\n\n#pagehelper\npagehelper:\n  # helper-dialect: mysql\n  #分页插件会自动检测当前的数据库链接，自动选择合适的分页方式。 你可以配置helperDialect 属性来指定分页插件使用哪种方言。\n  auto-runtime-dialect: true\n  #分页合理化参数，默认值为 false 。当该参数设置为 true 时， pageNum<=0 时会查询第一页， pageNum>pages （超过总数时），会查询最后一页。\n  reasonable: true\n  #支持通过Mapper接口参数传递page参数,默认值为false\n  support-methods-arguments: true\n  #默认值为 false ，当该参数设置为 true 时，如果 pageSize=0 或者 RowBounds.limit =0 就会查询出全部的结果（相当于没有执行分页查询，但是返回结果仍然是 Page 类型）。\n  page-size-zero: true\n  #为了支持 startPage(Object params) 方法，增加了该参数来配置参数映射，用于从对象中根据属性名取值\n  params: count=countSql\n\n# feign\nfeign:\n  okhttp:\n    enabled: true\n  sentinel:\n    enabled: true\n  client:\n    config:\n      default:\n        connectTimeout: 100000\n        readTimeout: 100000\n\n# knife4j配置\nknife4j:\n  #启用\n  enable: true\n  #基础认证\n  basic:\n    enable: false\n    username: startdis\n    password: 123456\n  #增强配置\n  setting:\n    enableSwaggerModels: true\n    enableDocumentManage: true\n    enableHost: false\n    enableHostText: http://localhost\n    enableRequestCache: true\n    enableFilterMultipartApis: false\n    enableFilterMultipartApiMethodType: POST\n    language: zh-CN\n    enableFooter: false\n    enableFooterCustom: true\n    footerCustomContent: Copyright © 2021 Startdis All Rights Reserved\n\n# 定义日志类型\nlogback:\n  fileType: log\n\nspring:\n    # 循环依赖的问题\n  main:\n    allow-circular-references: true\n  # MVC默认的路径匹配策略为PATH_PATTERN_PARSER，需要修改为ANT_PATH_MATCHER 解决swagger兼容性问题\n  mvc:\n    pathmatch:\n      matching-strategy: ANT_PATH_MATCHER', '7c792c66ec95d07f96fe4b02e88c8797', '2024-08-17 02:51:14', '2024-08-17 02:51:13', 'nacos', '192.168.31.18', 'D', 'local', '');
INSERT INTO `his_config_info` VALUES (34, 124, 'code-engine-web.yaml', 'engine', 'engine', 'spring:\n  config:\n    activate:\n      on-profile: local\n  servlet:\n    multipart:\n      # 上传文件总的最大值\n      max-request-size: 10MB\n      # 单个文件的最大值\n      max-file-size: 10MB\n  datasource:\n    # postgresql\n    url: jdbc:postgresql://1.13.21.54:5432/dev-code-engine?allowMultiQueries=true&useUnicode=true&characterEncoding=UTF-8&serverTimezone=Asia/Shanghai&useSSL=false&nullCatalogMeansCurrent=true\n    driver-class-name: org.postgresql.Driver\n    username: postgres\n    password: ydsz1020\n    type: com.alibaba.druid.pool.DruidDataSource\n    # 下面为连接池的补充设置，应用到上面所有数据源中\n    # 初始化大小，最小，最大\n    initial-size: 5\n    min-idle: 5\n    max-active: 20\n    # 配置获取连接等待超时的时间\n    max-wait: 60000\n    # 配置间隔多久才进行一次检测，检测需要关闭的空闲连接，单位是毫秒\n    time-between-eviction-runs-millis: 60000\n    # 配置一个连接在池中最小生存的时间，单位是毫秒\n    min-evictable-idle-time-millis: 300000\n    # mysql\n    # validation-query: SELECT 1 FROM DUAL\n    # postgre\n    validation-query: SELECT 1\n    test-while-idle: true\n    test-on-borrow: false\n    test-on-return: false\n    # 打开PSCache，并且指定每个连接上PSCache的大小\n    pool-prepared-statements: true\n    #   配置监控统计拦截的filters，去掉后监控界面sql无法统计，\'wall\'用于防火墙\n    max-pool-prepared-statement-per-connection-size: 20\n    filters: stat,wall\n    use-global-data-source-stat: true\n    # 通过connectProperties属性来打开mergeSql功能；慢SQL记录\n    connect-properties: druid.stat.mergeSql=true;druid.stat.slowSqlMillis=5000\n  redis:\n    database: 0\n    host: 1.13.21.54\n    password: ydsz1020\n    port: 6379\n    jedis:\n      pool:\n        max-active: 8\n        max-idle: 8\n        min-idle: 0\n        timeout: 1000\n# 异步线程配置\nasync:\n  executor:\n    thread:\n      # 核心线程数\n      corePoolSize: 10\n      # 最大线程数\n      maxPoolSize: 20\n      # 任务队列大小\n      queueCapacity: 1000\n      # 缓冲队列中线程的空闲时间\n      keepAliveSeconds: 300\n# MinIO\nminio:\n  #对象存储服务的URL\n  url: http://1.13.21.54:9000\n  #账户\n  accessKey: ydsz\n  #密码\n  secretKey: ydsz1020\n  #存储桶\n  bucketName: dev-code-engine\n\n# 拦截器\nsql-intercept:\n  tenant: \n    groupTenant: \n      enable: true\n    companyTenant: \n      enable: true\n    anonUrlSet: /login,/logout,/oauth2/authorize,/oauth2/token,/oauth2/check,/oauth2/callback,/getUserInfo\n  field-fill:\n    createdByIntercept:\n      enable: true\n    updateByIntercept:\n      enable: true\n    createAtIntercept:\n      enable: true\n    updateAtIntercept:\n      enable: true\n\n## 开启店铺id 拦截器\ninterceptor:\n  company:\n    enabled: true\n\n# 代码生成\ncode:\n  formatXml: false\n  basePath: /Users/dianjiu/Demos/code-engin-demo/\n\n\n# 开启系统操作日志\nlog:\n  record:\n    enabled: true\n# 日志输出路径配置\nlogback:\n  logDir: /Users/dianjiu/DevLogs/engine/code-engin/code-engin-web/\n# 定义日志输出级别\nlogging:\n  level:\n    com.scm: info\n    #spring 包日志输出级别\n    org.springframework: info\n    com.alibaba.cloud: info\n    # undertow\n    io.undertow: info\n    # mybatis-plus\n    com.baomidou.mybatisplus: debug\n    com.scm.scheduling.infra.mapper: debug\n', '92275d7db1be976fcbc4977332ef6dd7', '2024-08-17 02:51:14', '2024-08-17 02:51:13', 'nacos', '192.168.31.18', 'D', 'local', '');
