0\n  #账户\n  accessKey: ydsz\n  #密码\n  secretKey: ydsz1020\n  #存储桶\n  bucketName: petition-engine-local\n# SAP RFC配置\n# jco:\n  # client:\n    # SAP服务器\n    # ashost: 127.0.0.1\n    # SAP系统编号\n    # sysnr: 00\n    # SAP集团\n    # client: 100\n    # SAP用户\n    # user:   ST01_ADMIN\n    # SAP密码\n    # passwd: startdis2022\n    # SAP语言\n    # lang: EN\n  # destination:\n    # 最大连接数\n    # peakLimit: 10\n    # 最大连接线程\n    # poolCapacity: 30\n\n# 拦截器\nsql-intercept:\n  tenant: \n    groupTenant: \n      enable: true\n    companyTenant: \n      enable: true\n    anonUrlSet: /login,/logout,/oauth2/authorize,/oauth2/token,/oauth2/check,/oauth2/callback,/getUserInfo\n  field-fill:\n    createdByIntercept:\n      enable: true\n    updateByIntercept:\n      enable: true\n    createAtIntercept:\n      enable: true\n    updateAtIntercept:\n      enable: true\n\n## 开启店铺id 拦截器\ninterceptor:\n  company:\n    enabled: true\n\n# flowable 配置\nflowable:\n  # 关闭异步，不关闭历史数据的插入就是异步的，会在同一个事物里面，无法回滚\n  # 开发可开启会提高些效率，上线需要关闭\n  async-executor-activate: false\n  # 自动部署验证设置:true-开启（默认）、false-关闭\n  check-process-definitions: false\n\n# 开启系统操作日志\nlog:\n  record:\n    enabled: true\n# 日志输出路径配置\nlogback:\n  logDir: /Users/dianjiu/DevLogs/engine/code-engin/petition-engin-web/\n# 定义日志输出级别\nlogging:\n  level:\n    com.scm: info\n    #spring 包日志输出级别\n    org.springframework: info\n    com.alibaba.cloud: info\n    # undertow\n    io.undertow: info\n    # mybatis-plus\n    com.baomidou.mybatisplus: debug\n    com.scm.scheduling.infra.mapper: debug\n', '24ad2c3896e8b83fcb9f1565aeaa5016', '2024-08-17 02:51:14', '2024-08-17 02:51:13', 'nacos', '192.168.31.18', 'D', 'local', '');
