\n  #密码\n  secretKey: ydsz1020\n  #存储桶\n  bucketName: scmam\n\n# 拦截器\nsql-intercept:\n  tenant: \n    groupTenant: \n      enable: true\n    companyTenant: \n      enable: true\n    anonUrlSet: /user/getUserInfoByUserCode,/appInfo/list,/common/getUserInfo,/dept/getDeptByUserCode,/company/getCompanyInfoById,/roleMenu/initRedisRoleMenuByCode\n  field-fill:\n    createdByIntercept:\n      enable: true\n    updateByIntercept:\n      enable: true\n    createAtIntercept:\n      enable: true\n    updateAtIntercept:\n      enable: true\n\n## 开启店铺id 拦截器\ninterceptor:\n  company:\n    enabled: true\n\n# 开启系统操作日志\nlog:\n  record:\n    enabled: true\n    pushUrl: http://localhost:6103/operateLog/add\n    appName: MPS\n# 日志输出路径配置\nlogback:\n  logDir: /Logs/ydsz/sdt-scmam/${spring.application.name}/\n  fileType: log\n# 定义日志输出级别\nlogging:\n  level:\n    com.scm: info\n    #spring 包日志输出级别\n    org.springframework: info\n    com.alibaba.cloud: info\n    # undertow\n    io.undertow: info\n    # mybatis-plus\n    com.baomidou.mybatisplus: debug\n    com.scm.scheduling.infra.mapper: debug\n# 应用信息\nappInfo:\n  code: mps\n  key: jtgn1tk3\n  secret: 604c038a46a3330d15f2ca8570357b0d', '07a43806d2e251ae16e84017a43a0742', '2024-08-17 02:52:11', '2024-08-17 02:52:10', 'nacos', '192.168.31.18', 'D', 'dev', '');
