INSERT INTO `his_config_info` VALUES (67, 155, 'tdcd-application-local.yaml', 'local', 'sys', '# 服务端口号\r\nserver:\r\n  # tomcat 配置\r\n  tomcat:\r\n    # tomcat的URI编码\r\n    uri-encoding: UTF-8\r\n    # tomcat最大线程数，默认为200\r\n    max-threads: 500\r\n    # Tomcat启动初始化的线程数，默认值25\r\n    min-spare-threads: 30\r\n\r\n# mybatis-plus\r\nmybatis-plus:\r\n  configuration:\r\n    #控制台打印完整带参数SQL语句\r\n    log-impl: org.apache.ibatis.logging.stdout.StdOutImpl\r\n  #mapper映射文件路径\r\n  mapper-locations: classpath*:/*-infra/src/main/resources/mapper/*.xml,classpath*:/common-log/src/main/resources/mapper/*.xml, classpath*:/mapper/**.xml\r\n\r\n#pagehelper\r\npagehelper:\r\n  # helper-dialect: mysql\r\n  #分页插件会自动检测当前的数据库链接，自动选择合适的分页方式。 你可以配置helperDialect 属性来指定分页插件使用哪种方言。\r\n  auto-runtime-dialect: true\r\n  #分页合理化参数，默认值为 false 。当该参数设置为 true 时， pageNum<=0 时会查询第一页， pageNum>pages （超过总数时），会查询最后一页。\r\n  reasonable: true\r\n  #支持通过Mapper接口参数传递page参数,默认值为false\r\n  support-methods-arguments: true\r\n  #默认值为 false ，当该参数设置为 true 时，如果 pageSize=0 或者 RowBounds.limit =0 就会查询出全部的结果（相当于没有执行分页查询，但是返回结果仍然是 Page 类型）。\r\n  page-size-zero: true\r\n  #为了支持 startPage(Object params) 方法，增加了该参数来配置参数映射，用于从对象中根据属性名取值\r\n  params: count=countSql\r\n\r\n# feign\r\nfeign:\r\n  okhttp:\r\n    enabled: true\r\n  sentinel:\r\n    enabled: true\r\n  client:\r\n    config:\r\n      default:\r\n        connectTimeout: 100000\r\n        readTimeout: 100000\r\n\r\n# knife4j配置\r\nknife4j:\r\n  #启用\r\n  enable: true\r\n  #基础认证\r\n  basic:\r\n    enable: false\r\n    username: startdis\r\n    password: 123456\r\n  #增强配置\r\n  setting:\r\n    enableSwaggerModels: true\r\n    enableDocumentManage: true\r\n    enableHost: false\r\n    enableHostText: http://localhost\r\n    enableRequestCache: true\r\n    enableFilterMultipartApis: false\r\n    enableFilterMultipartApiMethodType: POST\r\n    language: zh-CN\r\n    enableFooter: false\r\n    enableFooterCustom: true\r\n    footerCustomContent: Copyright © 2021 Startdis All Rights Reserved\r\n\r\n# 定义日志类型\r\nlogback:\r\n  fileType: log\r\n\r\nspring:\r\n    # 循环依赖的问题\r\n  main:\r\n    allow-circular-references: true\r\n  # MVC默认的路径匹配策略为PATH_PATTERN_PARSER，需要修改为ANT_PATH_MATCHER 解决swagger兼容性问题\r\n  mvc:\r\n    pathmatch:\r\n      matching-strategy: ANT_PATH_MATCHER', 'd37b051d1870895f0cb68e3d1167ba33', '2024-08-17 02:52:42', '2024-08-17 02:52:41', 'nacos', '192.168.31.18', 'D', '', '');
