INSERT INTO `his_config_info` VALUES (0, 169, 'gateway-properties', 'dev', 'demo', '[{\r\n	\"id\": \"sys-web\",\r\n	\"uri\": \"lb://sys-web\",\r\n	\"predicates\": [{\r\n		\"name\": \"Path\",\r\n		\"args\": {\r\n			\"pattern\": \"/api/web/sys/**\"\r\n		}\r\n	}],\r\n	\"filters\": [{\r\n		\"name\": \"StripPrefix\",\r\n		\"args\": {\r\n			\"parts\": \"3\"\r\n		}\r\n	}]\r\n}]', '0ec45ca207405724d5dbbd072c35cffa', '2024-08-17 03:00:34', '2024-08-17 03:00:33', NULL, '192.168.31.18', 'I', 'dev', '');
