INSERT INTO `his_config_info` VALUES (74, 173, 'sdt-iam-web-dev.yaml', 'dev', 'cloud', 'spring:\n  application:\n    name: sdt-iam-web\n  config:\n    activate:\n      on-profile: dev\n  servlet:\n    multipart:\n      # 上传文件总的最大值\n      max-request-size: 100MB\n      # 单个文件的最大值\n      max-file-size: 100MB\n  datasource:\n    # mysql\n    url: jdbc:mysql://192.168.31.66:3306/sdt-saas-iam?allowMultiQueries=true&useUnicode=true&characterEncoding=UTF-8&serverTimezone=Asia/Shanghai&useSSL=false&nullCatalogMeansCurrent=true\n    driver-class-name: com.mysql.cj.jdbc.Driver\n    username: root\n    password: 123456\n    type: com.alibaba.druid.pool.DruidDataSource\n    # 下面为连接池的补充设置，应用到上面所有数据源中\n    # 初始化大小，最小，最大\n    initial-size: 5\n    min-idle: 5\n    max-active: 20\n    # 配置获取连接等待超时的时间\n    max-wait: 60000\n    # 配置间隔多久才进行一次检测，检测需要关闭的空闲连接，单位是毫秒\n    time-between-eviction-runs-millis: 60000\n    # 配置一个连接在池中最小生存的时间，单位是毫秒\n    min-evictable-idle-time-millis: 300000\n    # mysql\n    validation-query: SELECT 1 FROM DUAL\n    test-while-idle: true\n    test-on-borrow: false\n    test-on-return: false\n    # 打开PSCache，并且指定每个连接上PSCache的大小\n    pool-prepared-statements: true\n    #   配置监控统计拦截的filters，去掉后监控界面sql无法统计，\'wall\'用于防火墙\n    max-pool-prepared-statement-per-connection-size: 20\n    filters: stat,wall\n    use-global-data-source-stat: true\n    # 通过connectProperties属性来打开mergeSql功能；慢SQL记录\n    connect-properties: druid.stat.mergeSql=true;druid.stat.slowSqlMillis=5000\n  redis:\n    database: 0\n    host: 192.168.31.66\n    password: ydsz1020\n    port: 6379\n    jedis:\n      pool:\n        max-active: 8\n        max-idle: 8\n        min-idle: 0\n        timeout: 1000\n\n# 异步线程配置\nasync:\n  executor:\n    thread:\n      # 核心线程数\n      corePoolSize: 10\n      # 最大线程数\n      maxPoolSize: 30\n      # 任务队列大小\n      queueCapacity: 3000\n      # 缓冲队列中线程的空闲时间\n      keepAliveSeconds: 300\n      \n# MinIO\nminio:\n  #对象存储服务的URL\n  url: http://192.168.31.88:9000\n  #账户\n  accessKey: admin\n  #密码\n  secretKey: Sdt@1020~\n  #存储桶\n  bucketName: sdt-paas-iam\n\n# 拦截器\nsql-intercept:\n  tenant: \n    deptTenant: \n      enable: true\n    companyTenant: \n      enable: true\n    anonUrlSet: /sso/login/ticket,/sso/login/other,/sso/login/local,/sso/logout,/sso/oauth2/accessToken,/sso/oauth2/refreshToken,/sso/oauth2/checkToken,/logRecord/add,/logRecord/pageLogin,/logRecord/pageOperate,/logRecord/pageException\n  field-fill:\n    createdByIntercept:\n      enable: true\n    updateByIntercept:\n      enable: true\n    createAtIntercept:\n      enable: true\n    updateAtIntercept:\n      enable: true\n# springdoc-openapi项目配置\nspringdoc:\n  #是否开启文档功能\n  group-configs:\n    - group: \'iam-web\'\n      paths-to-match: \'/**\'\n      packages-to-scan: com.startdis.iam.web\n\n# 开启系统操作日志\nlog:\n  record:\n    enabled: true\n    appName: IAM\n    pushUrl: http://localhost:6103/operateLog/add\n\n# 日志输出路径配置\nlogback:\n  logDir: D:\\Logs\\sdt\\cloud\\${spring.application.name}\\\n  maxSize: 500MB\n  maxDays: 30\n\n# 应用信息\nappInfo:\n  code: iam\n  key: kxxyuc46\n  secret: f62b0078aa9b9bcc953b71d614fe999b', '868c6510f6b070d0228ae789b3803338', '2024-08-17 16:56:25', '2024-08-17 16:56:24', 'nacos', '192.168.31.18', 'U', 'dev', '');
