Key: admin\n  #密码\n  secretKey: Sdt@1020~\n  #存储桶\n  bucketName: sdt-cloud\n\n# 拦截器\nsql-intercept:\n  tenant: \n    deptTenant: \n      enable: true\n    companyTenant: \n      enable: true\n    anonUrlSet: /sso/login/ticket,/sso/login/other,/sso/login/local,/sso/logout,/sso/oauth2/accessToken,/sso/oauth2/refreshToken,/sso/oauth2/checkToken,/logRecord/get/,/logRecord/add,/logRecord/pageLogin,/logRecord/pageOperate,/logRecord/pageException\n  field-fill:\n    createdByIntercept:\n      enable: true\n    updateByIntercept:\n      enable: true\n    createAtIntercept:\n      enable: true\n    updateAtIntercept:\n      enable: true\n# springdoc-openapi项目配置\nspringdoc:\n  #是否开启文档功能\n  group-configs:\n    - group: \'iam-web\'\n      paths-to-match: \'/**\'\n      packages-to-scan: com.startdis.iam.web\n\n# 开启系统操作日志\nlog:\n  record:\n    enabled: true\n    appName: IAM\n    pushUrl: http://localhost:6103/operateLog/add\n\n# 日志输出路径配置\nlogback:\n  logDir: D:\\Logs\\sdt\\cloud\\${spring.application.name}\\\n  maxSize: 500MB\n  maxDays: 30\n\n# 应用信息\nappInfo:\n  code: iam\n  key: kxxyuc46\n  secret: f62b0078aa9b9bcc953b71d614fe999b', '2a70135ead8a8dadca99def7328f2d7c', '2024-08-17 20:21:17', '2024-08-17 20:21:15', 'nacos', '192.168.31.18', 'U', 'dev', '');
