Key: admin\n  #密码\n  secretKey: Sdt@1020~\n  #存储桶\n  bucketName: sdt-cloud\n\n# 拦截器\nsql-intercept:\n  tenant: \n    deptTenant: \n      enable: true\n    companyTenant: \n      enable: true\n    anonUrlSet: /sso/login/ticket,/sso/login/other,/sso/login/local,/sso/logout,/sso/oauth2/accessToken,/sso/oauth2/refreshToken,/sso/oauth2/checkToken,/logRecord/add,/logRecord/pageLogin,/logRecord/pageOperate,/logRecord/pageException,/logRecord/get/\n  field-fill:\n    createdByIntercept:\n      enable: true\n    updateByIntercept:\n      enable: true\n    createAtIntercept:\n      enable: true\n    updateAtIntercept:\n      enable: true\n# springdoc-openapi项目配置\nspringdoc:\n  #是否开启文档功能\n  group-configs:\n    - group: \'iam-web\'\n      paths-to-match: \'/**\'\n      packages-to-scan: com.startdis.iam.web\n\n# 开启系统操作日志\nlog:\n  record:\n    enabled: true\n    appName: IAM\n    pushUrl: http://localhost:6103/operateLog/add\n\n# 日志输出路径配置\nlogback:\n  logDir: D:\\Logs\\sdt\\cloud\\${spring.application.name}\\\n  maxSize: 500MB\n  maxDays: 30\n\n# 应用信息\nappInfo:\n  code: iam\n  key: kxxyuc46\n  secret: f62b0078aa9b9bcc953b71d614fe999b', 'cc0acbf78e372e0e615ec632c0bbc65e', '2024-08-17 20:23:05', '2024-08-17 20:23:03', 'nacos', '192.168.31.18', 'U', 'dev', '');
INSERT INTO `his_config_info` VALUES (0, 179, 'gateway-dev.yaml', 'dev', 'cloud', 'spring:\n  cloud:\n    # gateway 配置\n    gateway:\n      discovery:\n        locator:\n          #表明gateway开启服务注册和发现的功能，并且Spring cloud gateway自动根据服务发现为每一个服务创建了一个router，这个router将以服务名开头的请求路径转发到对应的服务\n          enabled: true\n          #是将请求路径上的服务名配置为小写（因为服务注册的时候，向注册中心注册时将服务名转成大写的了\n          lowerCaseServiceId: true\n          #另一种写法\n          #lower-case-service-id: true\n      #路由配置\n      # routes:\n      #   - id: sys-web\n      #     uri: lb://sys-web\n      #     # uri: http://1.13.171.235:18081/\n      #     predicates:\n      #       - Path=/web-api/sys/**\n      #     filters:\n      #       - StripPrefix=2\n      #跨域设置\n      # globalcors:\n      #   corsConfigurations:\n      #     \'[/**]\':\n      #       allowedOriginPatterns: \"*\"\n      #       allowed-methods: \"*\"\n      #       allowed-headers: \"*\"\n      #       allow-credentials: true\n      #       exposedHeaders: \"Content-Disposition,Content-Type,Cache-Control\"\n\n# 安全配置\nsecurity:\n  # 不校验白名单\n  ignore:\n    urls:\n      - \"/springboot/user/login\"\n      - \"/springboot/user/register\"\n      - \"/springboot/v2/api-docs\"\n \n# 暴露监控端点\nmanagement:\n  endpoints:\n    web:\n      exposure:\n        include: \'*\'\n  endpoint:\n    health:\n      show-details: always\n\n# 开启系统操作日志\nlog:\n  record:\n    enabled: true\n    appName: GW\n    pushUrl: http://localhost:6103/operateLog/add\n\n# 日志输出路径配置\nlogback:\n  logDir: D:\\Logs\\sdt\\cloud\\gateway\\\n\n\n', '8cd4d89c55210f4c3afb5e98a3202c92', '2024-08-18 15:29:46', '2024-08-18 15:29:42', NULL, '192.168.31.18', 'I', 'dev', '');
