INSERT INTO `his_config_info` VALUES (78, 185, 'gateway-dev.yaml', 'dev', 'cloud', 'spring:\n  cloud:\n    # gateway 配置\n    gateway:\n      discovery:\n        locator:\n          #表明gateway开启服务注册和发现的功能，并且Spring cloud gateway自动根据服务发现为每一个服务创建了一个router，这个router将以服务名开头的请求路径转发到对应的服务\n          enabled: true\n          #是将请求路径上的服务名配置为小写（因为服务注册的时候，向注册中心注册时将服务名转成大写的了\n          lowerCaseServiceId: true\n          #另一种写法\n          #lower-case-service-id: true\n      #路由配置\n      # routes:\n      #   - id: sys-web\n      #     uri: lb://sys-web\n      #     # uri: http://1.13.171.235:18081/\n      #     predicates:\n      #       - Path=/web-api/sys/**\n      #     filters:\n      #       - StripPrefix=2\n      #跨域设置\n      # globalcors:\n      #   corsConfigurations:\n      #     \'[/**]\':\n      #       allowedOriginPatterns: \"*\"\n      #       allowed-methods: \"*\"\n      #       allowed-headers: \"*\"\n      #       allow-credentials: true\n      #       exposedHeaders: \"Content-Disposition,Content-Type,Cache-Control\"\n\n# 安全配置\nsecurity:\n  # 不校验白名单\n  ignore:\n    urls:\n      - \"/springboot/user/login\"\n      - \"/springboot/user/register\"\n      - \"/springboot/v2/api-docs\"\n \n# 暴露监控端点\nmanagement:\n  endpoints:\n    web:\n      exposure:\n        include: \'*\'\n  endpoint:\n    health:\n      show-details: always\n\n# 开启系统操作日志\nlog:\n  record:\n    enabled: true\n    appName: GW\n    pushUrl: http://localhost:6103/operateLog/add\n\n# 日志输出路径配置\nlogback:\n  logDir: D:\\Logs\\sdt\\cloud\\gateway\\\n\n\n', '8cd4d89c55210f4c3afb5e98a3202c92', '2024-08-18 15:32:19', '2024-08-18 15:32:15', 'nacos', '192.168.31.18', 'D', 'dev', '');
INSERT INTO `his_config_info` VALUES (79, 186, 'gateway-properties', 'dev', 'cloud', '[{\n	\"id\": \"iam-web\",\n	\"uri\": \"lb://sdt-iam-web\",\n	\"predicates\": [{\n		\"name\": \"Path\",\n		\"args\": {\n			\"pattern\": \"/api/web/iam/**\"\n		}\n	}],\n	\"filters\": [{\n		\"name\": \"StripPrefix\",\n		\"args\": {\n			\"parts\": \"3\"\n		}\n	}]\n}]', 'bfd803467bd9a0f18fb9fddb87b3f1d1', '2024-08-18 15:32:19', '2024-08-18 15:32:15', 'nacos', '192.168.31.18', 'D', 'dev', '');
INSERT INTO `his_config_info` VALUES (73, 187, 'cloud-dev.yaml', 'dev', 'cloud', '# 服务端口号\nserver:\n  # tomcat 配置\n  tomcat:\n    # tomcat的URI编码\n    uri-encoding: UTF-8\n    # tomcat最大线程数，默认为200\n    max-threads: 500\n    # Tomcat启动初始化的线程数，默认值25\n    min-spare-threads: 30\n\n# mybatis-plus\nmybatis-plus:\n  configuration:\n    #控制台打印完整带参数SQL语句\n    log-impl: org.apache.ibatis.logging.stdout.StdOutImpl\n  #mapper映射文件路径\n  mapper-locations: classpath*:/*-infra/src/main/resources/mapper/*.xml, classpath*:/mapper/**.xml\n\n#pagehelper\npagehelper:\n  # helper-dialect: mysql\n  #分页插件会自动检测当前的数据库链接，自动选择合适的分页方式。 你可以配置helperDialect 属性来指定分页插件使用哪种方言。\n  auto-runtime-dialect: true\n  #分页合理化参数，默认值为 false 。当该参数设置为 true 时， pageNum<=0 时会查询第一页， pageNum>pages （超过总数时），会查询最后一页。\n  reasonable: true\n  #支持通过Mapper接口参数传递page参数,默认值为false\n  support-methods-arguments: true\n  #默认值为 false ，当该参数设置为 true 时，如果 pageSize=0 或者 RowBounds.limit =0 就会查询出全部的结果（相当于没有执行分页查询，但是返回结果仍然是 Page 类型）。\n  page-size-zero: true\n  #为了支持 startPage(Object params) 方法，增加了该参数来配置参数映射，用于从对象中根据属性名取值\n  params: count=countSql\n  \n# feign\nfeign:\n  okhttp:\n    enabled: true\n  hystrix:\n    enabled: true\n  sentinel:\n    enabled: true\n  client:\n    config:\n      default:\n        connectTimeout: 100000\n        readTimeout: 100000\n\n# springdoc-openapi项目配置\nspringdoc:\n  swagger-ui:\n    path: /swagger-ui.html\n  api-docs:\n    path: /v3/api-docs\n\n# knife4j的增强配置，不需要增强可以不配\nknife4j:\n  enable: true\n  setting:\n    language: zh-CN\n\n# 定义日志输出级别\nlogging:\n  level:\n    com.startdis: debug\n    # spring 包日志输出级别\n    org.springframework: info\n    # alibaba 包日志输出级别\n    com.alibaba.cloud: info\n    # nacos 心跳 INFO 屏蔽\n    com.alibaba.nacos: off\n    # undertow\n    io.undertow: info\n    # mybatis-plus\n    com.baomidou.mybatisplus: debug\n\nspring:\n    # 循环依赖的问题\n  main:\n    allow-circular-references: true\n  # MVC默认的路径匹配策略为PATH_PATTERN_PARSER，需要修改为ANT_PATH_MATCHER 解决swagger兼容性问题\n  mvc:\n    pathmatch:\n      matching-strategy: ANT_PATH_MATCHER', 'a0477dbca09826cf3025b6303f4707c9', '2024-08-18 16:50:00', '2024-08-18 16:49:57', 'nacos', '192.168.31.18', 'U', 'dev', '');
INSERT INTO `his_config_info` VALUES (80, 188, 'sdt-gateway-dev.yaml', 'dev', 'cloud', 'spring:\n  cloud:\n    # gateway 配置\n    gateway:\n      discovery:\n        locator:\n          #表明gateway开启服务注册和发现的功能，并且Spring cloud gateway自动根据服务发现为每一个服务创建了一个router，这个router将以服务名开头的请求路径转发到对应的服务\n          enabled: true\n          #是将请求路径上的服务名配置为小写（因为服务注册的时候，向注册中心注册时将服务名转成大写的了\n          lowerCaseServiceId: true\n          #另一种写法\n          #lower-case-service-id: true\n      #路由配置\n      # routes:\n      #   - id: sys-web\n      #     uri: lb://sys-web\n      #     # uri: http://1.13.171.235:18081/\n      #     predicates:\n      #       - Path=/web-api/sys/**\n      #     filters:\n      #       - StripPrefix=2\n      #跨域设置\n      # globalcors:\n      #   corsConfigurations:\n      #     \'[/**]\':\n      #       allowedOriginPatterns: \"*\"\n      #       allowed-methods: \"*\"\n      #       allowed-headers: \"*\"\n      #       allow-credentials: true\n      #       exposedHeaders: \"Content-Disposition,Content-Type,Cache-Control\"\n\n# 安全配置\nsecurity:\n  # 不校验白名单\n  ignore:\n    urls:\n      - \"/springboot/user/login\"\n      - \"/springboot/user/register\"\n      - \"/springboot/v2/api-docs\"\n \n# 暴露监控端点\nmanagement:\n  endpoints:\n    web:\n      exposure:\n        include: \'*\'\n  endpoint:\n    health:\n      show-details: always\n\n# 开启系统操作日志\nlog:\n  record:\n    enabled: true\n    appName: GW\n    pushUrl: http://localhost:6103/operateLog/add\n\n# 日志输出路径配置\nlogback:\n  logDir: D:\\Logs\\sdt\\cloud\\gateway\\\n\n\n', '8cd4d89c55210f4c3afb5e98a3202c92', '2024-08-18 16:51:16', '2024-08-18 16:51:13', 'nacos', '192.168.31.18', 'U', 'dev', '');
