INSERT INTO `his_config_info` VALUES (80, 191, 'sdt-gateway-dev.yaml', 'dev', 'cloud', 'spring:\n  cloud:\n    # gateway 配置\n    gateway:\n      discovery:\n        locator:\n          #表明gateway开启服务注册和发现的功能，并且Spring cloud gateway自动根据服务发现为每一个服务创建了一个router，这个router将以服务名开头的请求路径转发到对应的服务\n          enabled: true\n          #是将请求路径上的服务名配置为小写（因为服务注册的时候，向注册中心注册时将服务名转成大写的了\n          lowerCaseServiceId: true\n          #另一种写法\n          #lower-case-service-id: true\n      #路由配置\n      routes:\n        - id: iam-web\n          uri: lb://sdt-iam-web\n          # uri: http://1.13.171.235:18081/\n          predicates:\n            - Path=/api/web/iam/**\n          filters:\n            - StripPrefix=3\n      #跨域设置\n      # globalcors:\n      #   corsConfigurations:\n      #     \'[/**]\':\n      #       allowedOriginPatterns: \"*\"\n      #       allowed-methods: \"*\"\n      #       allowed-headers: \"*\"\n      #       allow-credentials: true\n      #       exposedHeaders: \"Content-Disposition,Content-Type,Cache-Control\"\n\n# 安全配置\nsecurity:\n  # 不校验白名单\n  ignore:\n    urls:\n      - \"/springboot/user/login\"\n      - \"/springboot/user/register\"\n      - \"/springboot/v2/api-docs\"\n \n# 暴露监控端点\nmanagement:\n  endpoints:\n    web:\n      exposure:\n        include: \'*\'\n  endpoint:\n    health:\n      show-details: always\n\n# 开启系统操作日志\nlog:\n  record:\n    enabled: true\n    appName: GW\n    pushUrl: http://localhost:6103/operateLog/add\n\n# 日志输出路径配置\nlogback:\n  logDir: D:\\Logs\\sdt\\cloud\\gateway\\\n\n\n', 'd2b58d0614837d37d1584dcf32b4a412', '2024-08-18 17:12:39', '2024-08-18 17:12:36', 'nacos', '192.168.31.18', 'U', 'dev', '');
