INSERT INTO `his_config_info` VALUES (0, 195, 'sdt-lce-web-dev.yaml', 'dev', 'cloud', 'spring:\r\n  application:\r\n    name: sdt-lce-web\r\n  config:\r\n    activate:\r\n      on-profile: dev\r\n  servlet:\r\n    multipart:\r\n      # 上传文件总的最大值\r\n      max-request-size: 100MB\r\n      # 单个文件的最大值\r\n      max-file-size: 100MB\r\n  datasource:\r\n    # mysql\r\n    url: jdbc:mysql://192.168.31.66:3306/sdt-paas-lce?allowMultiQueries=true&useUnicode=true&characterEncoding=UTF-8&serverTimezone=Asia/Shanghai&useSSL=false&nullCatalogMeansCurrent=true\r\n    username: root\r\n    password: 123456\r\n    driver-class-name: com.mysql.cj.jdbc.Driver\r\n    type: com.alibaba.druid.pool.DruidDataSource\r\n    # 下面为连接池的补充设置，应用到上面所有数据源中\r\n    # 初始化大小，最小，最大\r\n    initial-size: 5\r\n    min-idle: 5\r\n    max-active: 20\r\n    # 配置获取连接等待超时的时间\r\n    max-wait: 60000\r\n    # 配置间隔多久才进行一次检测，检测需要关闭的空闲连接，单位是毫秒\r\n    time-between-eviction-runs-millis: 60000\r\n    # 配置一个连接在池中最小生存的时间，单位是毫秒\r\n    min-evictable-idle-time-millis: 300000\r\n    # mysql\r\n    validation-query: SELECT 1 FROM DUAL\r\n    test-while-idle: true\r\n    test-on-borrow: false\r\n    test-on-return: false\r\n    # 打开PSCache，并且指定每个连接上PSCache的大小\r\n    pool-prepared-statements: true\r\n    #   配置监控统计拦截的filters，去掉后监控界面sql无法统计，\'wall\'用于防火墙\r\n    max-pool-prepared-statement-per-connection-size: 20\r\n    filters: stat,wall\r\n    use-global-data-source-stat: true\r\n    # 通过connectProperties属性来打开mergeSql功能；慢SQL记录\r\n    connect-properties: druid.stat.mergeSql=true;druid.stat.slowSqlMillis=5000\r\n  redis:\r\n    database: 0\r\n    host: 192.168.31.66\r\n    password: ydsz1020\r\n    port: 6379\r\n    jedis:\r\n      pool:\r\n        max-active: 8\r\n        max-idle: 8\r\n        min-idle: 0\r\n        timeout: 1000\r\n\r\n# 异步线程配置\r\nasync:\r\n  executor:\r\n    thread:\r\n      # 核心线程数\r\n      corePoolSize: 10\r\n      # 最大线程数\r\n      maxPoolSize: 30\r\n      # 任务队列大小\r\n      queueCapacity: 3000\r\n      # 缓冲队列中线程的空闲时间\r\n      keepAliveSeconds: 300\r\n\r\n# MinIO\r\nminio:\r\n  #对象存储服务的URL\r\n  url: http://192.168.31.88:9000\r\n  #账户\r\n  accessKey: admin\r\n  #密码\r\n  secretKey: Sdt@1020~\r\n  #存储桶\r\n  bucketName: sdt-cloud\r\n\r\n# XXL-JOB\r\nxxl-job:\r\n  enabled: false\r\n  # 调度中心部署跟地址\r\n  adminAddresses: http://127.0.0.1:8080/xxl-job-admin\r\n  # 执行器通讯TOKEN\r\n  accessToken:\r\n  # 执行器\r\n  executor:\r\n    # 执行器AppName\r\n    appname: sdt-ids-job\r\n    # 执行器注册地址\r\n    address:\r\n    # 执行器IP\r\n    ip:\r\n    # 执行器端口号\r\n    port:\r\n    # 执行器运行日志文件存储磁盘路径\r\n    logPath: /app/logs/sdt-ids-job\r\n    # 执行器日志文件保存天数\r\n    logRetentionDays: 30\r\n  \r\n\r\n# 拦截器\r\nsql-intercept:\r\n  tenant: \r\n    deptTenant: \r\n      enable: true\r\n    companyTenant: \r\n      enable: true\r\n    anonUrlSet: /user/getUserInfoByUserCode,/appInfo/list,/common/getUserInfo,/dept/getDeptByUserCode,/company/getCompanyInfoById,/operateLog/add,/operateLog/page,/operateLog/logPage\r\n  field-fill:\r\n    createdByIntercept:\r\n      enable: true\r\n    updateByIntercept:\r\n      enable: true\r\n    createAtIntercept:\r\n      enable: true\r\n    updateAtIntercept:\r\n      enable: true\r\n\r\n## 开启店铺id 拦截器\r\ninterceptor:\r\n  company:\r\n    enabled: true\r\n\r\ncode:\r\n  formatXml: true\r\n  basePath: D:\\\\Codes\\\\demo\r\n\r\n# 开启系统操作日志\r\nlog:\r\n  record:\r\n    appName: LCE\r\n    enabled: false\r\n    pushUrl: http://localhost:6103/operateLog/add\r\n\r\n# 日志输出路径配置\r\nlogback:\r\n  logDir: D:\\Logs\\sdt\\cloud\\${spring.application.name}\\\r\n  fileType: log\r\n\r\n# 应用信息\r\nappInfo:\r\n  code: ids\r\n  key: kxxyuc46\r\n  secret: f62b0078aa9b9bcc953b71d614fe999b', '7ca48bddca69a2d5c6329dbb950bfe66', '2024-08-18 18:03:16', '2024-08-18 18:03:13', 'nacos', '192.168.31.18', 'I', 'dev', '');
INSERT INTO `his_config_info` VALUES (80, 196, 'sdt-gateway-dev.yaml', 'dev', 'cloud', 'spring:\n  cloud:\n    # gateway 配置\n    gateway:\n      discovery:\n        locator:\n          #表明gateway开启服务注册和发现的功能，并且Spring cloud gateway自动根据服务发现为每一个服务创建了一个router，这个router将以服务名开头的请求路径转发到对应的服务\n          enabled: true\n          #是将请求路径上的服务名配置为小写（因为服务注册的时候，向注册中心注册时将服务名转成大写的了\n          lowerCaseServiceId: true\n          #另一种写法\n          #lower-case-service-id: true\n      #路由配置\n      # routes:\n      #   - id: iam-web\n      #     uri: lb://sdt-iam-web\n      #     # uri: http://1.13.171.235:18081/\n      #     predicates:\n      #       - Path=/api/web/iam/**\n      #     filters:\n      #       - StripPrefix=3\n      #跨域设置\n      # globalcors:\n      #   corsConfigurations:\n      #     \'[/**]\':\n      #       allowedOriginPatterns: \"*\"\n      #       allowed-methods: \"*\"\n      #       allowed-headers: \"*\"\n      #       allow-credentials: true\n      #       exposedHeaders: \"Content-Disposition,Content-Type,Cache-Control\"\n\n# 安全配置\nsecurity:\n  # 不校验白名单\n  ignore:\n    urls:\n      - \"/springboot/user/login\"\n      - \"/springboot/user/register\"\n      - \"/springboot/v2/api-docs\"\n \n# 暴露监控端点\nmanagement:\n  endpoints:\n    web:\n      exposure:\n        include: \'*\'\n  endpoint:\n    health:\n      show-details: always\n\n# 开启系统操作日志\nlog:\n  record:\n    enabled: true\n    appName: GW\n    pushUrl: http://localhost:6103/operateLog/add\n\n# 日志输出路径配置\nlogback:\n  logDir: D:\\Logs\\sdt\\cloud\\gateway\\\n\n\n', '488f97b1adce738bb2c108f828849143', '2024-08-18 18:03:27', '2024-08-18 18:03:24', 'nacos', '192.168.31.18', 'D', 'dev', '');
INSERT INTO `his_config_info` VALUES (81, 197, 'sdt-gateway-properties', 'dev', 'cloud', '[{\n	\"id\": \"iam-web\",\n	\"uri\": \"lb://sdt-iam-web\",\n	\"predicates\": [{\n		\"name\": \"Path\",\n		\"args\": {\n			\"pattern\": \"/api/web/iam/**\"\n		}\n	}],\n	\"filters\": [{\n		\"name\": \"StripPrefix\",\n		\"args\": {\n			\"parts\": \"3\"\n		}\n	}]\n}]', 'bfd803467bd9a0f18fb9fddb87b3f1d1', '2024-08-18 18:03:27', '2024-08-18 18:03:24', 'nacos', '192.168.31.18', 'D', 'dev', '');
INSERT INTO `his_config_info` VALUES (82, 198, 'sdt-lce-web-dev.yaml', 'dev', 'cloud', 'spring:\r\n  application:\r\n    name: sdt-lce-web\r\n  config:\r\n    activate:\r\n      on-profile: dev\r\n  servlet:\r\n    multipart:\r\n      # 上传文件总的最大值\r\n      max-request-size: 100MB\r\n      # 单个文件的最大值\r\n      max-file-size: 100MB\r\n  datasource:\r\n    # mysql\r\n    url: jdbc:mysql://192.168.31.66:3306/sdt-paas-lce?allowMultiQueries=true&useUnicode=true&characterEncoding=UTF-8&serverTimezone=Asia/Shanghai&useSSL=false&nullCatalogMeansCurrent=true\r\n    username: root\r\n    password: 123456\r\n    driver-class-name: com.mysql.cj.jdbc.Driver\r\n    type: com.alibaba.druid.pool.DruidDataSource\r\n    # 下面为连接池的补充设置，应用到上面所有数据源中\r\n    # 初始化大小，最小，最大\r\n    initial-size: 5\r\n    min-idle: 5\r\n    max-active: 20\r\n    # 配置获取连接等待超时的时间\r\n    max-wait: 60000\r\n    # 配置间隔多久才进行一次检测，检测需要关闭的空闲连接，单位是毫秒\r\n    time-between-eviction-runs-millis: 60000\r\n    # 配置一个连接在池中最小生存的时间，单位是毫秒\r\n    min-evictable-idle-time-millis: 300000\r\n    # mysql\r\n    validation-query: SELECT 1 FROM DUAL\r\n    test-while-idle: true\r\n    test-on-borrow: false\r\n    test-on-return: false\r\n    # 打开PSCache，并且指定每个连接上PSCache的大小\r\n    pool-prepared-statements: true\r\n    #   配置监控统计拦截的filters，去掉后监控界面sql无法统计，\'wall\'用于防火墙\r\n    max-pool-prepared-statement-per-connection-size: 20\r\n    filters: stat,wall\r\n    use-global-data-source-stat: true\r\n    # 通过connectProperties属性来打开mergeSql功能；慢SQL记录\r\n    connect-properties: druid.stat.mergeSql=true;druid.stat.slowSqlMillis=5000\r\n  redis:\r\n    database: 0\r\n    host: 192.168.31.66\r\n    password: ydsz1020\r\n    port: 6379\r\n    jedis:\r\n      pool:\r\n        max-active: 8\r\n        max-idle: 8\r\n        min-idle: 0\r\n        timeout: 1000\r\n\r\n# 异步线程配置\r\nasync:\r\n  executor:\r\n    thread:\r\n      # 核心线程数\r\n      corePoolSize: 10\r\n      # 最大线程数\r\n      maxPoolSize: 30\r\n      # 任务队列大小\r\n      queueCapacity: 3000\r\n      # 缓冲队列中线程的空闲时间\r\n      keepAliveSeconds: 300\r\n\r\n# MinIO\r\nminio:\r\n  #对象存储服务的URL\r\n  url: http://192.168.31.88:9000\r\n  #账户\r\n  accessKey: admin\r\n  #密码\r\n  secretKey: Sdt@1020~\r\n  #存储桶\r\n  bucketName: sdt-cloud\r\n\r\n# XXL-JOB\r\nxxl-job:\r\n  enabled: false\r\n  # 调度中心部署跟地址\r\n  adminAddresses: http://127.0.0.1:8080/xxl-job-admin\r\n  # 执行器通讯TOKEN\r\n  accessToken:\r\n  # 执行器\r\n  executor:\r\n    # 执行器AppName\r\n    appname: sdt-ids-job\r\n    # 执行器注册地址\r\n    address:\r\n    # 执行器IP\r\n    ip:\r\n    # 执行器端口号\r\n    port:\r\n    # 执行器运行日志文件存储磁盘路径\r\n    logPath: /app/logs/sdt-ids-job\r\n    # 执行器日志文件保存天数\r\n    logRetentionDays: 30\r\n  \r\n\r\n# 拦截器\r\nsql-intercept:\r\n  tenant: \r\n    deptTenant: \r\n      enable: true\r\n    companyTenant: \r\n      enable: true\r\n    anonUrlSet: /user/getUserInfoByUserCode,/appInfo/list,/common/getUserInfo,/dept/getDeptByUserCode,/company/getCompanyInfoById,/operateLog/add,/operateLog/page,/operateLog/logPage\r\n  field-fill:\r\n    createdByIntercept:\r\n      enable: true\r\n    updateByIntercept:\r\n      enable: true\r\n    createAtIntercept:\r\n      enable: true\r\n    updateAtIntercept:\r\n      enable: true\r\n\r\n## 开启店铺id 拦截器\r\ninterceptor:\r\n  company:\r\n    enabled: true\r\n\r\ncode:\r\n  formatXml: true\r\n  basePath: D:\\\\Codes\\\\demo\r\n\r\n# 开启系统操作日志\r\nlog:\r\n  record:\r\n    appName: LCE\r\n    enabled: false\r\n    pushUrl: http://localhost:6103/operateLog/add\r\n\r\n# 日志输出路径配置\r\nlogback:\r\n  logDir: D:\\Logs\\sdt\\cloud\\${spring.application.name}\\\r\n  fileType: log\r\n\r\n# 应用信息\r\nappInfo:\r\n  code: ids\r\n  key: kxxyuc46\r\n  secret: f62b0078aa9b9bcc953b71d614fe999b', '7ca48bddca69a2d5c6329dbb950bfe66', '2024-08-18 18:43:23', '2024-08-18 18:43:21', 'nacos', '192.168.31.18', 'U', 'dev', '');
INSERT INTO `his_config_info` VALUES (82, 199, 'sdt-lce-web-dev.yaml', 'dev', 'cloud', 'spring:\n  application:\n    name: sdt-lce-web\n  config:\n    activate:\n      on-profile: dev\n  servlet:\n    multipart:\n      # 上传文件总的最大值\n      max-request-size: 100MB\n      # 单个文件的最大值\n      max-file-size: 100MB\n  datasource:\n    # mysql\n    url: jdbc:mysql://192.168.31.66:3306/sdt-paas-lce?allowMultiQueries=true&useUnicode=true&characterEncoding=UTF-8&serverTimezone=Asia/Shanghai&useSSL=false&nullCatalogMeansCurrent=true\n    username: root\n    password: 123456\n    driver-class-name: com.mysql.cj.jdbc.Driver\n    type: com.alibaba.druid.pool.DruidDataSource\n    # 下面为连接池的补充设置，应用到上面所有数据源中\n    # 初始化大小，最小，最大\n    initial-size: 5\n    min-idle: 5\n    max-active: 20\n    # 配置获取连接等待超时的时间\n    max-wait: 60000\n    # 配置间隔多久才进行一次检测，检测需要关闭的空闲连接，单位是毫秒\n    time-between-eviction-runs-millis: 60000\n    # 配置一个连接在池中最小生存的时间，单位是毫秒\n    min-evictable-idle-time-millis: 300000\n    # mysql\n    validation-query: SELECT 1 FROM DUAL\n    test-while-idle: true\n    test-on-borrow: false\n    test-on-return: false\n    # 打开PSCache，并且指定每个连接上PSCache的大小\n    pool-prepared-statements: true\n    #   配置监控统计拦截的filters，去掉后监控界面sql无法统计，\'wall\'用于防火墙\n    max-pool-prepared-statement-per-connection-size: 20\n    filters: stat,wall\n    use-global-data-source-stat: true\n    # 通过connectProperties属性来打开mergeSql功能；慢SQL记录\n    connect-properties: druid.stat.mergeSql=true;druid.stat.slowSqlMillis=5000\n  redis:\n    database: 0\n    host: 192.168.31.66\n    password: ydsz1020\n    port: 6379\n    jedis:\n      pool:\n        max-active: 8\n        max-idle: 8\n        min-idle: 0\n        timeout: 1000\n\n# 异步线程配置\nasync:\n  executor:\n    thread:\n      # 核心线程数\n      corePoolSize: 10\n      # 最大线程数\n      maxPoolSize: 30\n      # 任务队列大小\n      queueCapacity: 3000\n      # 缓冲队列中线程的空闲时间\n      keepAliveSeconds: 300\n\n# MinIO\nminio:\n  #对象存储服务的URL\n  url: http://192.168.31.88:9000\n  #账户\n  accessKey: admin\n  #密码\n  secretKey: Sdt@1020~\n  #存储桶\n  bucketName: sdt-cloud\n\n# XXL-JOB\nxxl-job:\n  enabled: false\n  # 调度中心部署跟地址\n  adminAddresses: http://127.0.0.1:8080/xxl-job-admin\n  # 执行器通讯TOKEN\n  accessToken:\n  # 执行器\n  executor:\n    # 执行器AppName\n    appname: sdt-lce-job\n    # 执行器注册地址\n    address:\n    # 执行器IP\n    ip:\n    # 执行器端口号\n    port:\n    # 执行器运行日志文件存储磁盘路径\n    logPath: /app/logs/sdt-lce-job\n    # 执行器日志文件保存天数\n    logRetentionDays: 30\n  \n\n# 拦截器\nsql-intercept:\n  tenant: \n    deptTenant: \n      enable: true\n    companyTenant: \n      enable: true\n    anonUrlSet:\n  field-fill:\n    createdByIntercept:\n      enable: true\n    updateByIntercept:\n      enable: true\n    createAtIntercept:\n      enable: true\n    updateAtIntercept:\n      enable: true\n\n## 开启店铺id 拦截器\ninterceptor:\n  company:\n    enabled: true\n\ncode:\n  formatXml: true\n  basePath: D:\\\\Codes\\\\demo\n\n# 开启系统操作日志\nlog:\n  record:\n    appName: LCE\n    enabled: false\n    pushUrl: http://localhost:6103/operateLog/add\n\n# 日志输出路径配置\nlogback:\n  logDir: D:\\Logs\\sdt\\cloud\\${spring.application.name}\\\n  fileType: log\n\n# 应用信息\nappInfo:\n  code: ids\n  key: kxxyuc46\n  secret: f62b0078aa9b9bcc953b71d614fe999b', 'c4ec29e70e8e4dea004f7593cc52358c', '2024-08-18 18:51:34', '2024-08-18 18:51:31', 'nacos', '192.168.31.18', 'U', 'dev', '');
INSERT INTO `his_config_info` VALUES (73, 200, 'cloud-dev.yaml', 'dev', 'cloud', '# 服务端口号\nserver:\n  # tomcat 配置\n  tomcat:\n    # tomcat的URI编码\n    uri-encoding: UTF-8\n    # tomcat最大线程数，默认为200\n    max-threads: 500\n    # Tomcat启动初始化的线程数，默认值25\n    min-spare-threads: 30\n\n# mybatis-plus\nmybatis-plus:\n  configuration:\n    #控制台打印完整带参数SQL语句\n    log-impl: org.apache.ibatis.logging.stdout.StdOutImpl\n  #mapper映射文件路径\n  mapper-locations: classpath*:/*-infra/src/main/resources/mapper/*.xml, classpath*:/mapper/**.xml\n\n#pagehelper\npagehelper:\n  # helper-dialect: mysql\n  #分页插件会自动检测当前的数据库链接，自动选择合适的分页方式。 你可以配置helperDialect 属性来指定分页插件使用哪种方言。\n  auto-runtime-dialect: true\n  #分页合理化参数，默认值为 false 。当该参数设置为 true 时， pageNum<=0 时会查询第一页， pageNum>pages （超过总数时），会查询最后一页。\n  reasonable: true\n  #支持通过Mapper接口参数传递page参数,默认值为false\n  support-methods-arguments: true\n  #默认值为 false ，当该参数设置为 true 时，如果 pageSize=0 或者 RowBounds.limit =0 就会查询出全部的结果（相当于没有执行分页查询，但是返回结果仍然是 Page 类型）。\n  page-size-zero: true\n  #为了支持 startPage(Object params) 方法，增加了该参数来配置参数映射，用于从对象中根据属性名取值\n  params: count=countSql\n  \n# feign\nfeign:\n  okhttp:\n    enabled: true\n  hystrix:\n    enabled: true\n  sentinel:\n    enabled: true\n  client:\n    config:\n      default:\n        connectTimeout: 100000\n        readTimeout: 100000\n\n# springdoc-openapi项目配置\nspringdoc:\n  swagger-ui:\n    path: /swagger-ui.html\n  api-docs:\n    path: /v3/api-docs\n\n# knife4j的增强配置，不需要增强可以不配\nknife4j:\n  # 开启增强配置 \n  enable: true\n  # 开启生产环境屏蔽\n  # production: true\n  setting:\n    language: zh-CN\n  # 账户密码\n  basic:\n    enable: true\n    username: startdis\n    password: startdis\n\n# 定义日志输出级别\nlogging:\n  level:\n    com.startdis: debug\n    # spring 包日志输出级别\n    org.springframework: info\n    # alibaba 包日志输出级别\n    com.alibaba.cloud: info\n    # nacos 心跳 INFO 屏蔽\n    com.alibaba.nacos: off\n    # undertow\n    io.undertow: info\n    # mybatis-plus\n    com.baomidou.mybatisplus: debug\n\nspring:\n    # 循环依赖的问题\n  main:\n    allow-circular-references: true\n  # MVC默认的路径匹配策略为PATH_PATTERN_PARSER，需要修改为ANT_PATH_MATCHER 解决swagger兼容性问题\n  mvc:\n    pathmatch:\n      matching-strategy: ANT_PATH_MATCHER', 'e768ed68018c7556bdbac82c423232fc', '2024-08-18 19:06:18', '2024-08-18 19:06:15', 'nacos', '192.168.31.18', 'U', 'dev', '');
INSERT INTO `his_config_info` VALUES (82, 201, 'sdt-lce-web-dev.yaml', 'dev', 'cloud', 'spring:\n  application:\n    name: sdt-lce-web\n  config:\n    activate:\n      on-profile: dev\n  servlet:\n    multipart:\n      # 上传文件总的最大值\n      max-request-size: 100MB\n      # 单个文件的最大值\n      max-file-size: 100MB\n  datasource:\n    # mysql\n    url: jdbc:mysql://192.168.31.66:3306/sdt-paas-lce?allowMultiQueries=true&useUnicode=true&characterEncoding=UTF-8&serverTimezone=Asia/Shanghai&useSSL=false&nullCatalogMeansCurrent=true\n    username: root\n    password: 123456\n    driver-class-name: com.mysql.cj.jdbc.Driver\n    type: com.alibaba.druid.pool.DruidDataSource\n    # 下面为连接池的补充设置，应用到上面所有数据源中\n    # 初始化大小，最小，最大\n    initial-size: 5\n    min-idle: 5\n    max-active: 20\n    # 配置获取连接等待超时的时间\n    max-wait: 60000\n    # 配置间隔多久才进行一次检测，检测需要关闭的空闲连接，单位是毫秒\n    time-between-eviction-runs-millis: 60000\n    # 配置一个连接在池中最小生存的时间，单位是毫秒\n    min-evictable-idle-time-millis: 300000\n    # mysql\n    validation-query: SELECT 1 FROM DUAL\n    test-while-idle: true\n    test-on-borrow: false\n    test-on-return: false\n    # 打开PSCache，并且指定每个连接上PSCache的大小\n    pool-prepared-statements: true\n    #   配置监控统计拦截的filters，去掉后监控界面sql无法统计，\'wall\'用于防火墙\n    max-pool-prepared-statement-per-connection-size: 20\n    filters: stat,wall\n    use-global-data-source-stat: true\n    # 通过connectProperties属性来打开mergeSql功能；慢SQL记录\n    connect-properties: druid.stat.mergeSql=true;druid.stat.slowSqlMillis=5000\n  redis:\n    database: 0\n    host: 192.168.31.66\n    password: ydsz1020\n    port: 6379\n    jedis:\n      pool:\n        max-active: 8\n        max-idle: 8\n        min-idle: 0\n        timeout: 1000\n\n# 异步线程配置\nasync:\n  executor:\n    thread:\n      # 核心线程数\n      corePoolSize: 10\n      # 最大线程数\n      maxPoolSize: 30\n      # 任务队列大小\n      queueCapacity: 3000\n      # 缓冲队列中线程的空闲时间\n      keepAliveSeconds: 300\n\n# MinIO\nminio:\n  #对象存储服务的URL\n  url: http://192.168.31.88:9000\n  #账户\n  accessKey: admin\n  #密码\n  secretKey: Sdt@1020~\n  #存储桶\n  bucketName: sdt-cloud\n\n# XXL-JOB\nxxl-job:\n  enabled: false\n  # 调度中心部署跟地址\n  adminAddresses: http://127.0.0.1:8080/xxl-job-admin\n  # 执行器通讯TOKEN\n  accessToken:\n  # 执行器\n  executor:\n    # 执行器AppName\n    appname: sdt-lce-job\n    # 执行器注册地址\n    address:\n    # 执行器IP\n    ip:\n    # 执行器端口号\n    port:\n    # 执行器运行日志文件存储磁盘路径\n    logPath: /app/logs/sdt-lce-job\n    # 执行器日志文件保存天数\n    logRetentionDays: 30\n  \n\n# 拦截器\nsql-intercept:\n  tenant: \n    deptTenant: \n      enable: true\n    companyTenant: \n      enable: true\n    anonUrlSet:\n  field-fill:\n    createdByIntercept:\n      enable: true\n    updateByIntercept:\n      enable: true\n    createAtIntercept:\n      enable: true\n    updateAtIntercept:\n      enable: true\n\n## 开启店铺id 拦截器\ninterceptor:\n  company:\n    enabled: true\n\ncode:\n  formatXml: true\n  basePath: D:\\\\Codes\\\\demo\n\n# springdoc-openapi项目配置\nspringdoc:\n  #是否开启文档功能\n  group-configs:\n    - group: \'iam-web\'\n      paths-to-match: \'/**\'\n      packages-to-scan: com.startdis.lce.web\n\n# 开启系统操作日志\nlog:\n  record:\n    enabled: true\n    appName: LCE\n    pushUrl: http://localhost:6103/operateLog/add\n\n# 日志输出路径配置\nlogback:\n  logDir: D:\\Logs\\sdt\\cloud\\${spring.application.name}\\\n  maxSize: 500MB\n  maxDays: 30\n\n# 应用信息\nappInfo:\n  code: ids\n  key: kxxyuc46\n  secret: f62b0078aa9b9bcc953b71d614fe999b', '1351e45915bf50a392dec944697bacf7', '2024-08-18 19:08:30', '2024-08-18 19:08:27', 'nacos', '192.168.31.18', 'U', 'dev', '');
INSERT INTO `his_config_info` VALUES (82, 202, 'sdt-lce-web-dev.yaml', 'dev', 'cloud', 'spring:\n  application:\n    name: sdt-lce-web\n  config:\n    activate:\n      on-profile: dev\n  servlet:\n    multipart:\n      # 上传文件总的最大值\n      max-request-size: 100MB\n      # 单个文件的最大值\n      max-file-size: 100MB\n  datasource:\n    # mysql\n    url: jdbc:mysql://192.168.31.66:3306/sdt-paas-lce?allowMultiQueries=true&useUnicode=true&characterEncoding=UTF-8&serverTimezone=Asia/Shanghai&useSSL=false&nullCatalogMeansCurrent=true\n    driver-class-name: com.mysql.cj.jdbc.Driver\n    username: root\n    password: 123456\n    type: com.alibaba.druid.pool.DruidDataSource\n    # 下面为连接池的补充设置，应用到上面所有数据源中\n    # 初始化大小，最小，最大\n    initial-size: 5\n    min-idle: 5\n    max-active: 20\n    # 配置获取连接等待超时的时间\n    max-wait: 60000\n    # 配置间隔多久才进行一次检测，检测需要关闭的空闲连接，单位是毫秒\n    time-between-eviction-runs-millis: 60000\n    # 配置一个连接在池中最小生存的时间，单位是毫秒\n    min-evictable-idle-time-millis: 300000\n    # mysql\n    validation-query: SELECT 1 FROM DUAL\n    test-while-idle: true\n    test-on-borrow: false\n    test-on-return: false\n    # 打开PSCache，并且指定每个连接上PSCache的大小\n    pool-prepared-statements: true\n    #   配置监控统计拦截的filters，去掉后监控界面sql无法统计，\'wall\'用于防火墙\n    max-pool-prepared-statement-per-connection-size: 20\n    filters: stat,wall\n    use-global-data-source-stat: true\n    # 通过connectProperties属性来打开mergeSql功能；慢SQL记录\n    connect-properties: druid.stat.mergeSql=true;druid.stat.slowSqlMillis=5000\n  redis:\n    database: 0\n    host: 192.168.31.66\n    password: ydsz1020\n    port: 6379\n    jedis:\n      pool:\n        max-active: 8\n        max-idle: 8\n        min-idle: 0\n        timeout: 1000\n\n# 异步线程配置\nasync:\n  executor:\n    thread:\n      # 核心线程数\n      corePoolSize: 10\n      # 最大线程数\n      maxPoolSize: 30\n      # 任务队列大小\n      queueCapacity: 3000\n      # 缓冲队列中线程的空闲时间\n      keepAliveSeconds: 300\n      \n# MinIO\nminio:\n  #对象存储服务的URL\n  url: http://192.168.31.88:9000\n  #账户\n  accessKey: admin\n  #密码\n  secretKey: Sdt@1020~\n  #存储桶\n  bucketName: sdt-cloud\n\n# 拦截器\nsql-intercept:\n  tenant: \n    deptTenant: \n      enable: true\n    companyTenant: \n      enable: true\n    anonUrlSet: /sso/login/ticket,/sso/login/other,/sso/login/local,/sso/logout,/sso/oauth2/accessToken,/sso/oauth2/refreshToken,/sso/oauth2/checkToken,/logRecord/add,/logRecord/pageLogin,/logRecord/pageOperate,/logRecord/pageException,/logRecord/get\n  field-fill:\n    createdByIntercept:\n      enable: true\n    updateByIntercept:\n      enable: true\n    createAtIntercept:\n      enable: true\n    updateAtIntercept:\n      enable: true\n# springdoc-openapi项目配置\nspringdoc:\n  #是否开启文档功能\n  group-configs:\n    - group: \'lce-web\'\n      paths-to-match: \'/**\'\n      packages-to-scan: com.startdis.lce.web\n\n# 开启系统操作日志\nlog:\n  record:\n    enabled: true\n    appName: LCE\n    pushUrl: http://localhost:6103/operateLog/add\n\n# 日志输出路径配置\nlogback:\n  logDir: D:\\Logs\\sdt\\cloud\\${spring.application.name}\\\n  maxSize: 500MB\n  maxDays: 30\n\n# 应用信息\nappInfo:\n  code: lce\n  key: kxxyuc46\n  secret: f62b0078aa9b9bcc953b71d614fe999b', '0a7cb8e1c8e799d6cb248a5853351911', '2024-08-18 19:17:19', '2024-08-18 19:17:16', 'nacos', '192.168.31.18', 'U', 'dev', '');
INSERT INTO `his_config_info` VALUES (73, 203, 'cloud-dev.yaml', 'dev', 'cloud', '# 服务端口号\nserver:\n  # tomcat 配置\n  tomcat:\n    # tomcat的URI编码\n    uri-encoding: UTF-8\n    # tomcat最大线程数，默认为200\n    max-threads: 500\n    # Tomcat启动初始化的线程数，默认值25\n    min-spare-threads: 30\n\n# mybatis-plus\nmybatis-plus:\n  configuration:\n    #控制台打印完整带参数SQL语句\n    log-impl: org.apache.ibatis.logging.stdout.StdOutImpl\n  #mapper映射文件路径\n  mapper-locations: classpath*:/*-infra/src/main/resources/mapper/*.xml, classpath*:/mapper/**.xml\n\n#pagehelper\npagehelper:\n  # helper-dialect: mysql\n  #分页插件会自动检测当前的数据库链接，自动选择合适的分页方式。 你可以配置helperDialect 属性来指定分页插件使用哪种方言。\n  auto-runtime-dialect: true\n  #分页合理化参数，默认值为 false 。当该参数设置为 true 时， pageNum<=0 时会查询第一页， pageNum>pages （超过总数时），会查询最后一页。\n  reasonable: true\n  #支持通过Mapper接口参数传递page参数,默认值为false\n  support-methods-arguments: true\n  #默认值为 false ，当该参数设置为 true 时，如果 pageSize=0 或者 RowBounds.limit =0 就会查询出全部的结果（相当于没有执行分页查询，但是返回结果仍然是 Page 类型）。\n  page-size-zero: true\n  #为了支持 startPage(Object params) 方法，增加了该参数来配置参数映射，用于从对象中根据属性名取值\n  params: count=countSql\n  \n# feign\nfeign:\n  okhttp:\n    enabled: true\n  hystrix:\n    enabled: true\n  sentinel:\n    enabled: true\n  client:\n    config:\n      default:\n        connectTimeout: 100000\n        readTimeout: 100000\n\n# springdoc-openapi项目配置\nspringdoc:\n  swagger-ui:\n    path: /swagger-ui.html\n  api-docs:\n    path: /v3/api-docs\n\n# knife4j的增强配置，不需要增强可以不配\nknife4j:\n  # 开启增强配置 \n  enable: true\n  # 开启生产环境屏蔽\n  # production: true\n  setting:\n    language: zh-CN\n\n# 定义日志输出级别\nlogging:\n  level:\n    com.startdis: debug\n    # spring 包日志输出级别\n    org.springframework: info\n    # alibaba 包日志输出级别\n    com.alibaba.cloud: info\n    # nacos 心跳 INFO 屏蔽\n    com.alibaba.nacos: off\n    # undertow\n    io.undertow: info\n    # mybatis-plus\n    com.baomidou.mybatisplus: debug\n\nspring:\n    # 循环依赖的问题\n  main:\n    allow-circular-references: true\n  # MVC默认的路径匹配策略为PATH_PATTERN_PARSER，需要修改为ANT_PATH_MATCHER 解决swagger兼容性问题\n  mvc:\n    pathmatch:\n      matching-strategy: ANT_PATH_MATCHER', 'f11cee03f5b7aad4ec214171ee49b61f', '2024-08-18 19:22:52', '2024-08-18 19:22:49', 'nacos', '192.168.31.18', 'U', 'dev', '');
