策略为PATH_PATTERN_PARSER，需要修改为ANT_PATH_MATCHER 解决swagger兼容性问题\n  mvc:\n    pathmatch:\n      matching-strategy: ANT_PATH_MATCHER', 'b0498e9304d53116be131878a73bb1ef', '2024-08-18 19:28:18', '2024-08-18 19:28:15', 'nacos', '192.168.31.18', 'U', 'dev', '');
