Key: admin\n  #密码\n  secretKey: Sdt@1020~\n  #存储桶\n  bucketName: sdt-cloud\n\n# 拦截器\nsql-intercept:\n  tenant: \n    deptTenant: \n      enable: true\n    companyTenant: \n      enable: true\n    anonUrlSet: /sso/login/ticket,/sso/login/other,/sso/login/local,/sso/logout,/sso/oauth2/accessToken,/sso/oauth2/refreshToken,/sso/oauth2/checkToken,/logRecord/add,/logRecord/pageLogin,/logRecord/pageOperate,/logRecord/pageException,/logRecord/get\n  field-fill:\n    createdByIntercept:\n      enable: true\n    updateByIntercept:\n      enable: true\n    createAtIntercept:\n      enable: true\n    updateAtIntercept:\n      enable: true\n# springdoc-openapi项目配置\nspringdoc:\n  #是否开启文档功能\n  group-configs:\n    - group: \'lce-web\'\n      paths-to-match: \'/**\'\n      packages-to-scan: com.startdis.lce.web\n\n# 开启系统操作日志\nlog:\n  record:\n    enabled: true\n    appName: LCE\n    pushUrl: http://localhost:6103/operateLog/add\n\n# 日志输出路径配置\nlogback:\n  logDir: D:\\Logs\\sdt\\cloud\\${spring.application.name}\\\n  maxSize: 500MB\n  maxDays: 30\n\ncode:\n  formatXml: true\n  basePath: D:\\\\Codes\\\\demo\n\n# 应用信息\nappInfo:\n  code: lce\n  key: kxxyuc46\n  secret: f62b0078aa9b9bcc953b71d614fe999b', '200ba20b136506841751ff2a97d3aee2', '2024-08-18 22:13:11', '2024-08-18 22:13:08', 'nacos', '192.168.31.18', 'U', 'dev', '');
