io.undertow: info\n    # mybatis-plus\n    com.baomidou.mybatisplus: debug\n\nspring:\n    # 循环依赖的问题\n  main:\n    allow-circular-references: true\n    allow-bean-definition-overriding: true\n  # MVC默认的路径匹配策略为PATH_PATTERN_PARSER，需要修改为ANT_PATH_MATCHER 解决swagger兼容性问题\n  mvc:\n    pathmatch:\n      matching-strategy: ANT_PATH_MATCHER', 'cd7467b484078e8b03cf9998c77152fe', '2024-08-18 22:15:04', '2024-08-18 22:15:00', 'nacos', '192.168.31.18', 'U', 'dev', '');
INSERT INTO `his_config_info` VALUES (73, 211, 'cloud-dev.yaml', 'dev', 'cloud', '# 服务端口号\nserver:\n  # tomcat 配置\n  tomcat:\n    # tomcat的URI编码\n    uri-encoding: UTF-8\n    # tomcat最大线程数，默认为200\n    max-threads: 500\n    # Tomcat启动初始化的线程数，默认值25\n    min-spare-threads: 30\n\n# mybatis-plus\nmybatis-plus:\n  configuration:\n    #控制台打印完整带参数SQL语句\n    log-impl: org.apache.ibatis.logging.stdout.StdOutImpl\n  #mapper映射文件路径\n  mapper-locations: classpath*:/*-infra/src/main/resources/mapper/*.xml, classpath*:/mapper/**.xml\n\n#pagehelper\npagehelper:\n  # helper-dialect: mysql\n  #分页插件会自动检测当前的数据库链接，自动选择合适的分页方式。 你可以配置helperDialect 属性来指定分页插件使用哪种方言。\n  auto-runtime-dialect: true\n  #分页合理化参数，默认值为 false 。当该参数设置为 true 时， pageNum<=0 时会查询第一页， pageNum>pages （超过总数时），会查询最后一页。\n  reasonable: true\n  #支持通过Mapper接口参数传递page参数,默认值为false\n  support-methods-arguments: true\n  #默认值为 false ，当该参数设置为 true 时，如果 pageSize=0 或者 RowBounds.limit =0 就会查询出全部的结果（相当于没有执行分页查询，但是返回结果仍然是 Page 类型）。\n  page-size-zero: true\n  #为了支持 startPage(Object params) 方法，增加了该参数来配置参数映射，用于从对象中根据属性名取值\n  params: count=countSql\n  \n# feign\nfeign:\n  okhttp:\n    enabled: true\n  hystrix:\n    enabled: true\n  sentinel:\n    enabled: true\n  client:\n    config:\n      default:\n        connectTimeout: 100000\n        readTimeout: 100000\n\n# springdoc-openapi项目配置\nspringdoc:\n  api-docs:\n    enabled: true \n  #是否开启文档功能\n  group-configs:\n    - group: \'iam-web\'\n      paths-to-match: \'/api/web/iam/**\'\n      packages-to-scan: com.startdis.iam.web\n    - group: \'bpm-web\'\n      paths-to-match: \'/api/web/bpm/**\'\n      packages-to-scan: com.startdis.bpm.web\n    - group: \'xpe-web\'\n      paths-to-match: \'/api/web/xpe/**\'\n      packages-to-scan: com.startdis.xpe.web\n    - group: \'lce-web\'\n      paths-to-match: \'/api/web/lce/**\'\n      packages-to-scan: com.startdis.lce.web\n\n# knife4j的增强配置，不需要增强可以不配\nknife4j:\n  enable: true\n  setting:\n    language: zh-CN\n\n# 定义日志输出级别\nlogging:\n  level:\n    com.startdis: debug\n    # spring 包日志输出级别\n    org.springframework: info\n    # alibaba 包日志输出级别\n    com.alibaba.cloud: info\n    # nacos 心跳 INFO 屏蔽\n    com.alibaba.nacos: off\n    # undertow\n    io.undertow: info\n    # mybatis-plus\n    com.baomidou.mybatisplus: debug\n\nspring:\n    # 循环依赖的问题\n  main:\n    allow-circular-references: true\n    allow-bean-definition-overriding: true\n  # MVC默认的路径匹配策略为PATH_PATTERN_PARSER，需要修改为ANT_PATH_MATCHER 解决swagger兼容性问题\n  mvc:\n    pathmatch:\n      matching-strategy: ANT_PATH_MATCHER', '8141a1e4668e2188ad2a80e2f48e14a4', '2024-08-18 22:17:49', '2024-08-18 22:17:46', 'nacos', '192.168.31.18', 'U', 'dev', '');
INSERT INTO `his_config_info` VALUES (74, 212, 'sdt-iam-web-dev.yaml', 'dev', 'cloud', 'spring:\n  application:\n    name: sdt-iam-web\n  config:\n    activate:\n      on-profile: dev\n  servlet:\n    multipart:\n      # 上传文件总的最大值\n      max-request-size: 100MB\n      # 单个文件的最大值\n      max-file-size: 100MB\n  datasource:\n    # mysql\n    url: jdbc:mysql://192.168.31.66:3306/sdt-saas-iam?allowMultiQueries=true&useUnicode=true&characterEncoding=UTF-8&serverTimezone=Asia/Shanghai&useSSL=false&nullCatalogMeansCurrent=true\n    driver-class-name: com.mysql.cj.jdbc.Driver\n    username: root\n    password: 123456\n    type: com.alibaba.druid.pool.DruidDataSource\n    # 下面为连接池的补充设置，应用到上面所有数据源中\n    # 初始化大小，最小，最大\n    initial-size: 5\n    min-idle: 5\n    max-active: 20\n    # 配置获取连接等待超时的时间\n    max-wait: 60000\n    # 配置间隔多久才进行一次检测，检测需要关闭的空闲连接，单位是毫秒\n    time-between-eviction-runs-millis: 60000\n    # 配置一个连接在池中最小生存的时间，单位是毫秒\n    min-evictable-idle-time-millis: 300000\n    # mysql\n    validation-query: SELECT 1 FROM DUAL\n    test-while-idle: true\n    test-on-borrow: false\n    test-on-return: false\n    # 打开PSCache，并且指定每个连接上PSCache的大小\n    pool-prepared-statements: true\n    #   配置监控统计拦截的filters，去掉后监控界面sql无法统计，\'wall\'用于防火墙\n    max-pool-prepared-statement-per-connection-size: 20\n    filters: stat,wall\n    use-global-data-source-stat: true\n    # 通过connectProperties属性来打开mergeSql功能；慢SQL记录\n    connect-properties: druid.stat.mergeSql=true;druid.stat.slowSqlMillis=5000\n  redis:\n    database: 0\n    host: 192.168.31.66\n    password: ydsz1020\n    port: 6379\n    jedis:\n      pool:\n        max-active: 8\n        max-idle: 8\n        min-idle: 0\n        timeout: 1000\n\n# 异步线程配置\nasync:\n  executor:\n    thread:\n      # 核心线程数\n      corePoolSize: 10\n      # 最大线程数\n      maxPoolSize: 30\n      # 任务队列大小\n      queueCapacity: 3000\n      # 缓冲队列中线程的空闲时间\n      keepAliveSeconds: 300\n      \n# MinIO\nminio:\n  #对象存储服务的URL\n  url: http://192.168.31.88:9000\n  #账户\n  accessKey: admin\n  #密码\n  secretKey: Sdt@1020~\n  #存储桶\n  bucketName: sdt-cloud\n\n# 拦截器\nsql-intercept:\n  tenant: \n    deptTenant: \n      enable: true\n    companyTenant: \n      enable: true\n    anonUrlSet: /sso/login/ticket,/sso/login/other,/sso/login/local,/sso/logout,/sso/oauth2/accessToken,/sso/oauth2/refreshToken,/sso/oauth2/checkToken,/logRecord/add,/logRecord/pageLogin,/logRecord/pageOperate,/logRecord/pageException,/logRecord/get\n  field-fill:\n    createdByIntercept:\n      enable: true\n    updateByIntercept:\n      enable: true\n    createAtIntercept:\n      enable: true\n    updateAtIntercept:\n      enable: true\n\n# 开启系统操作日志\nlog:\n  record:\n    enabled: true\n    appName: IAM\n    pushUrl: http://localhost:6103/operateLog/add\n\n# 日志输出路径配置\nlogback:\n  logDir: D:\\Logs\\sdt\\cloud\\${spring.application.name}\\\n  maxSize: 500MB\n  maxDays: 30\n\n# 应用信息\nappInfo:\n  code: iam\n  key: kxxyuc46\n  secret: f62b0078aa9b9bcc953b71d614fe999b', '92c9610fc69251a3431954a28fb80a56', '2024-08-18 22:18:26', '2024-08-18 22:18:23', 'nacos', '192.168.31.18', 'U', 'dev', '');
