Key: admin\n  #密码\n  secretKey: Sdt@1020~\n  #存储桶\n  bucketName: sdt-cloud\n\n# 拦截器\nsql-intercept:\n  tenant: \n    deptTenant: \n      enable: true\n    companyTenant: \n      enable: true\n    anonUrlSet: /sso/login/ticket,/sso/login/other,/sso/login/local,/sso/logout,/sso/oauth2/accessToken,/sso/oauth2/refreshToken,/sso/oauth2/checkToken,/logRecord/add,/logRecord/pageLogin,/logRecord/pageOperate,/logRecord/pageException,/logRecord/get\n  field-fill:\n    createdByIntercept:\n      enable: true\n    updateByIntercept:\n      enable: true\n    createAtIntercept:\n      enable: true\n    updateAtIntercept:\n      enable: true\n\n# springdoc-openapi项目配置\nspringdoc:\n  api-docs:\n    enabled: true\n    path: /v3/api-docs\n  #是否开启文档功能\n  group-configs:\n    - group: \'lce-web\'\n      paths-to-match: \'/**\'\n      packages-to-scan: com.startdis.lce.web\n\nsdt-code:\n  formatXml: true\n  basePath: D:\\\\Codes\\\\demo\n\n# 日志输出路径配置\nlogback:\n  logDir: D:\\Logs\\sdt\\cloud\\${spring.application.name}\\', 'e3bf4a26eedada1708d3b99b4f3c7dd1', '2024-08-18 23:35:23', '2024-08-18 23:35:19', 'nacos', '192.168.31.18', 'U', 'dev', '');
