ey: admin\n  #密码\n  secretKey: Sdt@1020~\n  #存储桶\n  bucketName: sdt-cloud\n\n# 拦截器\nsql-intercept:\n  tenant: \n    deptTenant: \n      enable: true\n    companyTenant: \n      enable: true\n    anonUrlSet: /sso/login/ticket,/sso/login/other,/sso/login/local,/sso/logout,/sso/oauth2/accessToken,/sso/oauth2/refreshToken,/sso/oauth2/checkToken,/logRecord/add,/logRecord/pageLogin,/logRecord/pageOperate,/logRecord/pageException,/logRecord/get\n  field-fill:\n    createdByIntercept:\n      enable: true\n    updateByIntercept:\n      enable: true\n    createAtIntercept:\n      enable: true\n    updateAtIntercept:\n      enable: true\n\n# springdoc\nspringdoc:\n  group-configs:\n   - group: web\n     packages-to-scan: com.startdis.iam.web\n   - group: app\n     packages-to-scan: com.startdis.iam.app\n\n# 开启系统操作日志\nsdt-log:\n  record:\n    enabled: true\n    appName: iam-web\n    pushUrl: http://192.168.31.18:1010/logRecord/add', 'da5a4c795ca3c7881ff76b464a7d66c7', '2024-08-18 23:44:10', '2024-08-18 23:44:07', NULL, '192.168.31.18', 'I', 'back', '');
