INSERT INTO `his_config_info` VALUES (95, 259, 'sdt-comm-email.yaml', 'dev', '', 'spring:\n  datasource:\n    url: jdbc:mysql://localhost:3306/socks\n    username: root\n    password: 123456\n  mail:\n    host: smtp.exmail.qq.com\n    username: mail@point9.cn\n    password: Mw961124\n    sendTo: 246197796@qq.com,468792388@qq.com,mail@point9.cn\n    default-encoding: utf-8\n    fromName: Point9\n    properties:\n      mail.smtp.auth: true\n      mail.smtp.socketFactory.class: javax.net.ssl.SSLSocketFactory\n      mail.smtp.socketFactory.fallback: false\n      mail.smtp.socketFactory.port: 465\n  thymeleaf:\n    cache: false\n    content-type: \'text/html  \'\n    encoding: UTF-8\n    mode: HTML5\n    prefix: classpath:/static/template/\n    suffix: .html\n  freemarker:\n    allow-request-override: false\n    cache: false\n    charset: UTF-8\n    check-template-location: true\n    content-type: text/html\n    enabled: true\n    expose-request-attributes: false\n    expose-session-attributes: false\n    expose-spring-macro-helpers: false\n    template-loader-path: classpath:/static/template/\n\nsdt-comm:\n  mail:\n    protocol: smtp\n    smtpHost: smtp.exmail.qq.com\n    smtpPort: 465\n    fromName: 启迪平台\n    fromMail: cloud@startdis.com\n    password: Sdt1020\n    encoding: utf-8\n    ssl:\n      enabled: true\n      sslPort: 465', '65c7d10286917af883e7664270cbbba3', '2024-08-27 02:00:15', '2024-08-27 02:00:13', 'nacos', '192.168.31.18', 'U', 'back', '');
INSERT INTO `his_config_info` VALUES (12, 260, 'sdt-sso-web-dev.yaml', 'dev', 'paas', 'spring:\n  config:\n    activate:\n      on-profile: local\n  servlet:\n    multipart:\n      # 上传文件总的最大值\n      max-request-size: 10MB\n      # 单个文件的最大值\n      max-file-size: 10MB\n  application:\n    name: sdt-sso-web\n  datasource:\n    # mysql\n    url: jdbc:mysql://146.56.199.179:13306/sdt-center-dev?allowMultiQueries=true&useUnicode=true&characterEncoding=UTF-8&serverTimezone=Asia/Shanghai&useSSL=false&nullCatalogMeansCurrent=true\n    driver-class-name: com.mysql.cj.jdbc.Driver\n    username: root\n    password: ydsz1020\n    # postgresql\n    # url: jdbc:postgresql://1.13.21.54:5432/startdis_saas_sys?allowMultiQueries=true&useUnicode=true&characterEncoding=UTF-8&serverTimezone=Asia/Shanghai&useSSL=false&nullCatalogMeansCurrent=true\n    # driver-class-name: org.postgresql.Driver\n    # username: postgres\n    # password: ydsz1020\n    type: com.alibaba.druid.pool.DruidDataSource\n    # 下面为连接池的补充设置，应用到上面所有数据源中\n    # 初始化大小，最小，最大\n    initial-size: 5\n    min-idle: 5\n    max-active: 20\n    # 配置获取连接等待超时的时间\n    max-wait: 60000\n    # 配置间隔多久才进行一次检测，检测需要关闭的空闲连接，单位是毫秒\n    time-between-eviction-runs-millis: 60000\n    # 配置一个连接在池中最小生存的时间，单位是毫秒\n    min-evictable-idle-time-millis: 300000\n    # mysql\n    # validation-query: SELECT 1 FROM DUAL\n    # postgre\n    validation-query: SELECT 1\n    test-while-idle: true\n    test-on-borrow: false\n    test-on-return: false\n    # 打开PSCache，并且指定每个连接上PSCache的大小\n    pool-prepared-statements: true\n    #   配置监控统计拦截的filters，去掉后监控界面sql无法统计，\'wall\'用于防火墙\n    max-pool-prepared-statement-per-connection-size: 20\n    filters: stat,wall\n    use-global-data-source-stat: true\n    # 通过connectProperties属性来打开mergeSql功能；慢SQL记录\n    connect-properties: druid.stat.mergeSql=true;druid.stat.slowSqlMillis=5000\n  redis:\n    database: 3\n    host: 146.56.199.179\n    password: \n    port: 16379\n    jedis:\n      pool:\n        max-active: 8\n        max-idle: 8\n        min-idle: 0\n        timeout: 1000\n# 异步线程配置\nasync:\n  executor:\n    thread:\n      # 核心线程数\n      corePoolSize: 10\n      # 最大线程数\n      maxPoolSize: 20\n      # 任务队列大小\n      queueCapacity: 1000\n      # 缓冲队列中线程的空闲时间\n      keepAliveSeconds: 300\n# MinIO\nminio:\n  #对象存储服务的URL\n  url: http://192.168.2.201:9000\n  #账户\n  accessKey: ydsz\n  #密码\n  secretKey: ydsz1020\n  #存储桶\n  bucketName: wms\n\n# 拦截器\nsql-intercept:\n  tenant: \n    groupTenant: \n      enable: true\n    companyTenant: \n      enable: true\n    anonUrlSet: /login,/logout,/getUserToken,/oauth2/authorize,/oauth2/token,/oauth2/check,/oauth2/callback,/appInfo/list\n  field-fill:\n    createdByIntercept:\n      enable: true\n    updateByIntercept:\n      enable: true\n    createAtIntercept:\n      enable: true\n    updateAtIntercept:\n      enable: true\n\n## 开启店铺id 拦截器\ninterceptor:\n  company:\n    enabled: true\n\n# 开启系统操作日志\nlog:\n  record:\n    enabled: true\n    pushUrl: http://localhost:6103/operateLog/add\n    appName: SSO\n# 日志输出路径配置\nlogback:\n  logDir: /Users/dianjiu/Logs/ydsz/tdcd-cloud/tdcd-sys-web\n# 定义日志输出级别\nlogging:\n  level:\n    com.scm: info\n    #spring 包日志输出级别\n    org.springframework: info\n    com.alibaba.cloud: info\n    # undertow\n    io.undertow: info\n    # mybatis-plus\n    com.baomidou.mybatisplus: debug\n    com.scm.scheduling.infra.mapper: debug\n# 应用信息\nappInfo:\n  code: sso\n  key: wxez5w7u\n  secret: 406201a5d30068a239f25d619a574da3\nswagger:\n  enable: false', '8bd18d0acf2193d55146fef0c25bc521', '2024-08-30 00:02:09', '2024-08-30 00:02:08', 'nacos', '192.168.31.18', 'D', '', '');
