INSERT INTO `his_config_info` VALUES (28, 266, 'application-local.yaml', 'local', 'demo', '# 服务端口号\r\nserver:\r\n  # tomcat 配置\r\n  tomcat:\r\n    # tomcat的URI编码\r\n    uri-encoding: UTF-8\r\n    # tomcat最大线程数，默认为200\r\n    max-threads: 500\r\n    # Tomcat启动初始化的线程数，默认值25\r\n    min-spare-threads: 30\r\n\r\n# mybatis-plus\r\nmybatis-plus:\r\n  configuration:\r\n    #控制台打印完整带参数SQL语句\r\n    log-impl: org.apache.ibatis.logging.stdout.StdOutImpl\r\n  #mapper映射文件路径\r\n  mapper-locations: classpath*:/*-infra/src/main/resources/mapper/*.xml,classpath*:/common-log/src/main/resources/mapper/*.xml, classpath*:/mapper/**.xml\r\n\r\n#pagehelper\r\npagehelper:\r\n  # helper-dialect: mysql\r\n  #分页插件会自动检测当前的数据库链接，自动选择合适的分页方式。 你可以配置helperDialect 属性来指定分页插件使用哪种方言。\r\n  auto-runtime-dialect: true\r\n  #分页合理化参数，默认值为 false 。当该参数设置为 true 时， pageNum<=0 时会查询第一页， pageNum>pages （超过总数时），会查询最后一页。\r\n  reasonable: true\r\n  #支持通过Mapper接口参数传递page参数,默认值为false\r\n  support-methods-arguments: true\r\n  #默认值为 false ，当该参数设置为 true 时，如果 pageSize=0 或者 RowBounds.limit =0 就会查询出全部的结果（相当于没有执行分页查询，但是返回结果仍然是 Page 类型）。\r\n  page-size-zero: true\r\n  #为了支持 startPage(Object params) 方法，增加了该参数来配置参数映射，用于从对象中根据属性名取值\r\n  params: count=countSql\r\n\r\n# feign\r\nfeign:\r\n  okhttp:\r\n    enabled: true\r\n  sentinel:\r\n    enabled: true\r\n  client:\r\n    config:\r\n      default:\r\n        connectTimeout: 100000\r\n        readTimeout: 100000\r\n\r\n# knife4j配置\r\nknife4j:\r\n  #启用\r\n  enable: true\r\n  #基础认证\r\n  basic:\r\n    enable: false\r\n    username: startdis\r\n    password: 123456\r\n  #增强配置\r\n  setting:\r\n    enableSwaggerModels: true\r\n    enableDocumentManage: true\r\n    enableHost: false\r\n    enableHostText: http://localhost\r\n    enableRequestCache: true\r\n    enableFilterMultipartApis: false\r\n    enableFilterMultipartApiMethodType: POST\r\n    language: zh-CN\r\n    enableFooter: false\r\n    enableFooterCustom: true\r\n    footerCustomContent: Copyright © 2021 Startdis All Rights Reserved\r\n\r\n# 定义日志类型\r\nlogback:\r\n  fileType: log\r\n\r\nspring:\r\n    # 循环依赖的问题\r\n  main:\r\n    allow-circular-references: true\r\n  # MVC默认的路径匹配策略为PATH_PATTERN_PARSER，需要修改为ANT_PATH_MATCHER 解决swagger兼容性问题\r\n  mvc:\r\n    pathmatch:\r\n      matching-strategy: ANT_PATH_MATCHER', 'd37b051d1870895f0cb68e3d1167ba33', '2024-08-30 00:02:09', '2024-08-30 00:02:08', 'nacos', '192.168.31.18', 'D', '', '');
INSERT INTO `his_config_info` VALUES (29, 267, 'gateway-properties', 'local', 'demo', '[{\r\n	\"id\": \"sys-web\",\r\n	\"uri\": \"lb://sys-web\",\r\n	\"predicates\": [{\r\n		\"name\": \"Path\",\r\n		\"args\": {\r\n			\"pattern\": \"/api/web/sys/**\"\r\n		}\r\n	}],\r\n	\"filters\": [{\r\n		\"name\": \"StripPrefix\",\r\n		\"args\": {\r\n			\"parts\": \"3\"\r\n		}\r\n	}]\r\n}]', '0ec45ca207405724d5dbbd072c35cffa', '2024-08-30 00:02:09', '2024-08-30 00:02:08', 'nacos', '192.168.31.18', 'D', '', '');
INSERT INTO `his_config_info` VALUES (30, 268, 'gateway-public.yaml', 'local', 'demo', 'spring:\r\n  cloud:\r\n    # gateway 配置\r\n    gateway:\r\n      discovery:\r\n        locator:\r\n          #表明gateway开启服务注册和发现的功能，并且Spring cloud gateway自动根据服务发现为每一个服务创建了一个router，这个router将以服务名开头的请求路径转发到对应的服务\r\n          enabled: true\r\n          #是将请求路径上的服务名配置为小写（因为服务注册的时候，向注册中心注册时将服务名转成大写的了\r\n          lowerCaseServiceId: true\r\n          #另一种写法\r\n          #lower-case-service-id: true\r\n      #路由配置\r\n      # routes:\r\n      #   - id: sys-web\r\n      #     uri: lb://sys-web\r\n      #     # uri: http://1.13.171.235:18081/\r\n      #     predicates:\r\n      #       - Path=/web-api/sys/**\r\n      #     filters:\r\n      #       - StripPrefix=2\r\n      #跨域设置\r\n      # globalcors:\r\n      #   corsConfigurations:\r\n      #     \'[/**]\':\r\n      #       allowedOriginPatterns: \"*\"\r\n      #       allowed-methods: \"*\"\r\n      #       allowed-headers: \"*\"\r\n      #       allow-credentials: true\r\n      #       exposedHeaders: \"Content-Disposition,Content-Type,Cache-Control\"\r\n\r\n# 安全配置\r\nsecurity:\r\n  # 不校验白名单\r\n  ignore:\r\n    urls:\r\n      - \"/springboot/user/login\"\r\n      - \"/springboot/user/register\"\r\n      - \"/springboot/v2/api-docs\"\r\n \r\n# 暴露监控端点\r\nmanagement:\r\n  endpoints:\r\n    web:\r\n      exposure:\r\n        include: \'*\'\r\n  endpoint:\r\n    health:\r\n      show-details: always\r\n\r\n# 开启系统操作日志\r\nlog:\r\n  record:\r\n    enabled: true\r\n# 日志输出路径配置\r\nlogback:\r\n  logDir: /Users/dianjiu/DevLogs/startdis/startdis-saas/gateway/\r\n# 定义日志输出级别\r\nlogging:\r\n  level:\r\n    com.scm: info\r\n    #spring 包日志输出级别\r\n    org.springframework: info\r\n    com.alibaba.cloud: info\r\n    # undertow\r\n    io.undertow: info\r\n    # mybatis-plus\r\n    com.baomidou.mybatisplus: debug\r\n    com.scm.scheduling.infra.mapper: debug\r\n\r\n', 'e3d696f40055cd9d640f31d4d42bec81', '2024-08-30 00:02:09', '2024-08-30 00:02:08', 'nacos', '192.168.31.18', 'D', '', '');
INSERT INTO `his_config_info` VALUES (65, 269, 'sap-rfc.yaml', 'lcoal', 'demo', '# SAP RFC配置\r\n# jco:\r\n#   client:\r\n#     # SAP服务器\r\n#     ashost: 1.13.24.182\r\n#     # SAP系统编号\r\n#     sysnr: 00\r\n#     # SAP集团\r\n#     client: 100\r\n#     # SAP用户\r\n#     user:   ST01_ADMIN\r\n#     # SAP密码\r\n#     passwd: startdis2022\r\n#     # SAP语言\r\n#     lang: EN\r\n#   destination:\r\n#     # 最大连接数\r\n#     peakLimit: 10\r\n#     # 最大连接线程\r\n#     poolCapacity: 30', 'ee658e6b688eb1eff486d2134cfbc931', '2024-08-30 00:02:09', '2024-08-30 00:02:08', 'nacos', '192.168.31.18', 'D', '', '');
INSERT INTO `his_config_info` VALUES (0, 270, 'cloud-dev.yaml', 'dev', 'cloud', '# 服务端口号\nserver:\n  # tomcat 配置\n  tomcat:\n    # tomcat的URI编码\n    uri-encoding: UTF-8\n    # tomcat最大线程数，默认为200\n    max-threads: 500\n    # Tomcat启动初始化的线程数，默认值25\n    min-spare-threads: 30\n\nspring:\n    # 循环依赖的问题\n  main:\n    allow-circular-references: true\n  # MVC默认的路径匹配策略为PATH_PATTERN_PARSER，需要修改为ANT_PATH_MATCHER 解决swagger兼容性问题\n  mvc:\n    pathmatch:\n      matching-strategy: ANT_PATH_MATCHER\n\n# mybatis-plus\nmybatis-plus:\n  configuration:\n    #控制台打印完整带参数SQL语句\n    log-impl: org.apache.ibatis.logging.stdout.StdOutImpl\n  #mapper映射文件路径\n  mapper-locations: classpath*:/*-infra/src/main/resources/mapper/*.xml, classpath*:/mapper/**.xml\n\n#pagehelper\npagehelper:\n  # helper-dialect: mysql\n  #分页插件会自动检测当前的数据库链接，自动选择合适的分页方式。 你可以配置helperDialect 属性来指定分页插件使用哪种方言。\n  auto-runtime-dialect: true\n  #分页合理化参数，默认值为 false 。当该参数设置为 true 时， pageNum<=0 时会查询第一页， pageNum>pages （超过总数时），会查询最后一页。\n  reasonable: true\n  #支持通过Mapper接口参数传递page参数,默认值为false\n  support-methods-arguments: true\n  #默认值为 false ，当该参数设置为 true 时，如果 pageSize=0 或者 RowBounds.limit =0 就会查询出全部的结果（相当于没有执行分页查询，但是返回结果仍然是 Page 类型）。\n  page-size-zero: true\n  #为了支持 startPage(Object params) 方法，增加了该参数来配置参数映射，用于从对象中根据属性名取值\n  params: count=countSql\n  \n# feign\nfeign:\n  okhttp:\n    enabled: true\n  hystrix:\n    enabled: true\n  sentinel:\n    enabled: true\n  client:\n    config:\n      default:\n        connectTimeout: 100000\n        readTimeout: 100000\n\n# 定义日志输出级别\nlogging:\n  level:\n    com.startdis: debug\n    # spring 包日志输出级别\n    org.springframework: info\n    # alibaba 包日志输出级别\n    com.alibaba.cloud: info\n    # nacos 心跳 INFO 屏蔽\n    com.alibaba.nacos: off\n    # undertow\n    io.undertow: info\n    # mybatis-plus\n    com.baomidou.mybatisplus: debug\n\n# 日志输出路径配置\nlogback:\n  logDir: D:\\Logs\\sdt\\cloud\\${spring.application.name}\\', 'f5915e13333bb9171c954141c33a335d', '2024-08-30 00:02:17', '2024-08-30 00:02:17', NULL, '192.168.31.18', 'I', '', '');
INSERT INTO `his_config_info` VALUES (0, 271, 'sdt-iam-web-dev.yaml', 'dev', 'cloud', 'spring:\n  application:\n    name: sdt-iam-web\n  config:\n    activate:\n      on-profile: dev\n  servlet:\n    multipart:\n      # 上传文件总的最大值\n      max-request-size: 100MB\n      # 单个文件的最大值\n      max-file-size: 100MB\n  datasource:\n    # mysql\n    url: jdbc:mysql://192.168.31.66:3306/sdt-saas-iam?allowMultiQueries=true&useUnicode=true&characterEncoding=UTF-8&serverTimezone=Asia/Shanghai&useSSL=false&nullCatalogMeansCurrent=true\n    driver-class-name: com.mysql.cj.jdbc.Driver\n    username: root\n    password: 123456\n    type: com.alibaba.druid.pool.DruidDataSource\n    # 下面为连接池的补充设置，应用到上面所有数据源中\n    # 初始化大小，最小，最大\n    initial-size: 5\n    min-idle: 5\n    max-active: 20\n    # 配置获取连接等待超时的时间\n    max-wait: 60000\n    # 配置间隔多久才进行一次检测，检测需要关闭的空闲连接，单位是毫秒\n    time-between-eviction-runs-millis: 60000\n    # 配置一个连接在池中最小生存的时间，单位是毫秒\n    min-evictable-idle-time-millis: 300000\n    # mysql\n    validation-query: SELECT 1 FROM DUAL\n    test-while-idle: true\n    test-on-borrow: false\n    test-on-return: false\n    # 打开PSCache，并且指定每个连接上PSCache的大小\n    pool-prepared-statements: true\n    #   配置监控统计拦截的filters，去掉后监控界面sql无法统计，\'wall\'用于防火墙\n    max-pool-prepared-statement-per-connection-size: 20\n    filters: stat,wall\n    use-global-data-source-stat: true\n    # 通过connectProperties属性来打开mergeSql功能；慢SQL记录\n    connect-properties: druid.stat.mergeSql=true;druid.stat.slowSqlMillis=5000\n  redis:\n    database: 0\n    host: 192.168.31.66\n    password: ydsz1020\n    port: 6379\n    jedis:\n      pool:\n        max-active: 8\n        max-idle: 8\n        min-idle: 0\n        timeout: 1000\n\n# 异步线程配置\nasync:\n  executor:\n    thread:\n      # 核心线程数\n      corePoolSize: 10\n      # 最大线程数\n      maxPoolSize: 30\n      # 任务队列大小\n      queueCapacity: 3000\n      # 缓冲队列中线程的空闲时间\n      keepAliveSeconds: 300\n      \n# MinIO\nminio:\n  #对象存储服务的URL\n  url: http://192.168.31.88:9000\n  #账户\n  accessKey: admin\n  #密码\n  secretKey: Sdt@1020~\n  #存储桶\n  bucketName: sdt-cloud\n\n# 拦截器\nsql-intercept:\n  tenant: \n    deptTenant: \n      enable: true\n    companyTenant: \n      enable: true\n    anonUrlSet: /sso/login/ticket,/sso/login/other,/sso/login/local,/sso/logout,/sso/oauth2/accessToken,/sso/oauth2/refreshToken,/sso/oauth2/checkToken,/logRecord/add,/logRecord/pageLogin,/logRecord/pageOperate,/logRecord/pageException,/logRecord/get\n  field-fill:\n    createdByIntercept:\n      enable: true\n    updateByIntercept:\n      enable: true\n    createAtIntercept:\n      enable: true\n    updateAtIntercept:\n      enable: true\n\n# springdoc\nspringdoc:\n  group-configs:\n   - group: web\n     packages-to-scan: com.startdis.iam.web\n   - group: app\n     packages-to-scan: com.startdis.iam.app\n\n# 开启系统操作日志\nsdt-log:\n  record:\n    enabled: true\n    appName: iam-web\n    pushUrl: http://192.168.31.18:1010/logRecord/add', 'da5a4c795ca3c7881ff76b464a7d66c7', '2024-08-30 00:02:17', '2024-08-30 00:02:17', NULL, '192.168.31.18', 'I', '', '');
INSERT INTO `his_config_info` VALUES (0, 272, 'sdt-lce-web-dev.yaml', 'dev', 'cloud', 'spring:\n  application:\n    name: sdt-lce-web\n  config:\n    activate:\n      on-profile: dev\n  servlet:\n    multipart:\n      # 上传文件总的最大值\n      max-request-size: 100MB\n      # 单个文件的最大值\n      max-file-size: 100MB\n  datasource:\n    # mysql\n    url: jdbc:mysql://192.168.31.66:3306/sdt-paas-lce?allowMultiQueries=true&useUnicode=true&characterEncoding=UTF-8&serverTimezone=Asia/Shanghai&useSSL=false&nullCatalogMeansCurrent=true\n    driver-class-name: com.mysql.cj.jdbc.Driver\n    username: root\n    password: 123456\n    type: com.alibaba.druid.pool.DruidDataSource\n    # 下面为连接池的补充设置，应用到上面所有数据源中\n    # 初始化大小，最小，最大\n    initial-size: 5\n    min-idle: 5\n    max-active: 20\n    # 配置获取连接等待超时的时间\n    max-wait: 60000\n    # 配置间隔多久才进行一次检测，检测需要关闭的空闲连接，单位是毫秒\n    time-between-eviction-runs-millis: 60000\n    # 配置一个连接在池中最小生存的时间，单位是毫秒\n    min-evictable-idle-time-millis: 300000\n    # mysql\n    validation-query: SELECT 1 FROM DUAL\n    test-while-idle: true\n    test-on-borrow: false\n    test-on-return: false\n    # 打开PSCache，并且指定每个连接上PSCache的大小\n    pool-prepared-statements: true\n    #   配置监控统计拦截的filters，去掉后监控界面sql无法统计，\'wall\'用于防火墙\n    max-pool-prepared-statement-per-connection-size: 20\n    filters: stat,wall\n    use-global-data-source-stat: true\n    # 通过connectProperties属性来打开mergeSql功能；慢SQL记录\n    connect-properties: druid.stat.mergeSql=true;druid.stat.slowSqlMillis=5000\n  redis:\n    database: 0\n    host: 192.168.31.66\n    password: ydsz1020\n    port: 6379\n    jedis:\n      pool:\n        max-active: 8\n        max-idle: 8\n        min-idle: 0\n        timeout: 1000\n\n# 异步线程配置\nasync:\n  executor:\n    thread:\n      # 核心线程数\n      corePoolSize: 10\n      # 最大线程数\n      maxPoolSize: 30\n      # 任务队列大小\n      queueCapacity: 3000\n      # 缓冲队列中线程的空闲时间\n      keepAliveSeconds: 300\n      \n# MinIO\nminio:\n  #对象存储服务的URL\n  url: http://192.168.31.88:9000\n  #账户\n  accessKey: admin\n  #密码\n  secretKey: Sdt@1020~\n  #存储桶\n  bucketName: sdt-cloud\n\n# 拦截器\nsql-intercept:\n  tenant: \n    deptTenant: \n      enable: true\n    companyTenant: \n      enable: true\n    anonUrlSet: /sso/login/ticket,/sso/login/other,/sso/login/local,/sso/logout,/sso/oauth2/accessToken,/sso/oauth2/refreshToken,/sso/oauth2/checkToken,/logRecord/add,/logRecord/pageLogin,/logRecord/pageOperate,/logRecord/pageException,/logRecord/get\n  field-fill:\n    createdByIntercept:\n      enable: true\n    updateByIntercept:\n      enable: true\n    createAtIntercept:\n      enable: true\n    updateAtIntercept:\n      enable: true\n\n# springdoc\nspringdoc:\n  group-configs:\n   - group: web\n     packages-to-scan: com.startdis.lce.web\n   - group: app\n     packages-to-scan: com.startdis.lce.app\n\n# 开启系统操作日志\nsdt-log:\n  record:\n    enabled: true\n    appName: iam-web\n    pushUrl: http://192.168.31.18:1010/logRecord/add\n\nsdt-code:\n  formatXml: true\n  basePath: D:\\\\Codes\\\\demo', 'a64a894efa53e4976acf555de129b282', '2024-08-30 00:02:17', '2024-08-30 00:02:17', NULL, '192.168.31.18', 'I', '', '');
INSERT INTO `his_config_info` VALUES (83, 273, 'cloud-dev.yaml', 'dev', 'cloud', '# 服务端口号\nserver:\n  # tomcat 配置\n  tomcat:\n    # tomcat的URI编码\n    uri-encoding: UTF-8\n    # tomcat最大线程数，默认为200\n    max-threads: 500\n    # Tomcat启动初始化的线程数，默认值25\n    min-spare-threads: 30\n\nspring:\n    # 循环依赖的问题\n  main:\n    allow-circular-references: true\n  # MVC默认的路径匹配策略为PATH_PATTERN_PARSER，需要修改为ANT_PATH_MATCHER 解决swagger兼容性问题\n  mvc:\n    pathmatch:\n      matching-strategy: ANT_PATH_MATCHER\n\n# mybatis-plus\nmybatis-plus:\n  configuration:\n    #控制台打印完整带参数SQL语句\n    log-impl: org.apache.ibatis.logging.stdout.StdOutImpl\n  #mapper映射文件路径\n  mapper-locations: classpath*:/*-infra/src/main/resources/mapper/*.xml, classpath*:/mapper/**.xml\n\n#pagehelper\npagehelper:\n  # helper-dialect: mysql\n  #分页插件会自动检测当前的数据库链接，自动选择合适的分页方式。 你可以配置helperDialect 属性来指定分页插件使用哪种方言。\n  auto-runtime-dialect: true\n  #分页合理化参数，默认值为 false 。当该参数设置为 true 时， pageNum<=0 时会查询第一页， pageNum>pages （超过总数时），会查询最后一页。\n  reasonable: true\n  #支持通过Mapper接口参数传递page参数,默认值为false\n  support-methods-arguments: true\n  #默认值为 false ，当该参数设置为 true 时，如果 pageSize=0 或者 RowBounds.limit =0 就会查询出全部的结果（相当于没有执行分页查询，但是返回结果仍然是 Page 类型）。\n  page-size-zero: true\n  #为了支持 startPage(Object params) 方法，增加了该参数来配置参数映射，用于从对象中根据属性名取值\n  params: count=countSql\n  \n# feign\nfeign:\n  okhttp:\n    enabled: true\n  hystrix:\n    enabled: true\n  sentinel:\n    enabled: true\n  client:\n    config:\n      default:\n        connectTimeout: 100000\n        readTimeout: 100000\n\n# 定义日志输出级别\nlogging:\n  level:\n    com.startdis: debug\n    # spring 包日志输出级别\n    org.springframework: info\n    # alibaba 包日志输出级别\n    com.alibaba.cloud: info\n    # nacos 心跳 INFO 屏蔽\n    com.alibaba.nacos: off\n    # undertow\n    io.undertow: info\n    # mybatis-plus\n    com.baomidou.mybatisplus: debug\n\n# 日志输出路径配置\nlogback:\n  logDir: D:\\Logs\\sdt\\cloud\\${spring.application.name}\\', 'f5915e13333bb9171c954141c33a335d', '2024-08-30 00:02:25', '2024-08-30 00:02:25', 'nacos', '192.168.31.18', 'D', 'back', '');
INSERT INTO `his_config_info` VALUES (84, 274, 'sdt-iam-web-dev.yaml', 'dev', 'cloud', 'spring:\n  application:\n    name: sdt-iam-web\n  config:\n    activate:\n      on-profile: dev\n  servlet:\n    multipart:\n      # 上传文件总的最大值\n      max-request-size: 100MB\n      # 单个文件的最大值\n      max-file-size: 100MB\n  datasource:\n    # mysql\n    url: jdbc:mysql://192.168.31.66:3306/sdt-saas-iam?allowMultiQueries=true&useUnicode=true&characterEncoding=UTF-8&serverTimezone=Asia/Shanghai&useSSL=false&nullCatalogMeansCurrent=true\n    driver-class-name: com.mysql.cj.jdbc.Driver\n    username: root\n    password: 123456\n    type: com.alibaba.druid.pool.DruidDataSource\n    # 下面为连接池的补充设置，应用到上面所有数据源中\n    # 初始化大小，最小，最大\n    initial-size: 5\n    min-idle: 5\n    max-active: 20\n    # 配置获取连接等待超时的时间\n    max-wait: 60000\n    # 配置间隔多久才进行一次检测，检测需要关闭的空闲连接，单位是毫秒\n    time-between-eviction-runs-millis: 60000\n    # 配置一个连接在池中最小生存的时间，单位是毫秒\n    min-evictable-idle-time-millis: 300000\n    # mysql\n    validation-query: SELECT 1 FROM DUAL\n    test-while-idle: true\n    test-on-borrow: false\n    test-on-return: false\n    # 打开PSCache，并且指定每个连接上PSCache的大小\n    pool-prepared-statements: true\n    #   配置监控统计拦截的filters，去掉后监控界面sql无法统计，\'wall\'用于防火墙\n    max-pool-prepared-statement-per-connection-size: 20\n    filters: stat,wall\n    use-global-data-source-stat: true\n    # 通过connectProperties属性来打开mergeSql功能；慢SQL记录\n    connect-properties: druid.stat.mergeSql=true;druid.stat.slowSqlMillis=5000\n  redis:\n    database: 0\n    host: 192.168.31.66\n    password: ydsz1020\n    port: 6379\n    jedis:\n      pool:\n        max-active: 8\n        max-idle: 8\n        min-idle: 0\n        timeout: 1000\n\n# 异步线程配置\nasync:\n  executor:\n    thread:\n      # 核心线程数\n      corePoolSize: 10\n      # 最大线程数\n      maxPoolSize: 30\n      # 任务队列大小\n      queueCapacity: 3000\n      # 缓冲队列中线程的空闲时间\n      keepAliveSeconds: 300\n      \n# MinIO\nminio:\n  #对象存储服务的URL\n  url: http://192.168.31.88:9000\n  #账户\n  accessKey: admin\n  #密码\n  secretKey: Sdt@1020~\n  #存储桶\n  bucketName: sdt-cloud\n\n# 拦截器\nsql-intercept:\n  tenant: \n    deptTenant: \n      enable: true\n    companyTenant: \n      enable: true\n    anonUrlSet: /sso/login/ticket,/sso/login/other,/sso/login/local,/sso/logout,/sso/oauth2/accessToken,/sso/oauth2/refreshToken,/sso/oauth2/checkToken,/logRecord/add,/logRecord/pageLogin,/logRecord/pageOperate,/logRecord/pageException,/logRecord/get\n  field-fill:\n    createdByIntercept:\n      enable: true\n    updateByIntercept:\n      enable: true\n    createAtIntercept:\n      enable: true\n    updateAtIntercept:\n      enable: true\n\n# springdoc\nspringdoc:\n  group-configs:\n   - group: web\n     packages-to-scan: com.startdis.iam.web\n   - group: app\n     packages-to-scan: com.startdis.iam.app\n\n# 开启系统操作日志\nsdt-log:\n  record:\n    enabled: true\n    appName: iam-web\n    pushUrl: http://192.168.31.18:1010/logRecord/add', 'da5a4c795ca3c7881ff76b464a7d66c7', '2024-08-30 00:02:25', '2024-08-30 00:02:25', 'nacos', '192.168.31.18', 'D', 'back', '');
