: admin\n  #密码\n  secretKey: Sdt@1020~\n  #存储桶\n  bucketName: sdt-cloud\n\n# 拦截器\nsql-intercept:\n  tenant: \n    deptTenant: \n      enable: true\n    companyTenant: \n      enable: true\n    anonUrlSet: /sso/login/ticket,/sso/login/other,/sso/login/local,/sso/logout,/sso/oauth2/accessToken,/sso/oauth2/refreshToken,/sso/oauth2/checkToken,/logRecord/add,/logRecord/pageLogin,/logRecord/pageOperate,/logRecord/pageException,/logRecord/get\n  field-fill:\n    createdByIntercept:\n      enable: true\n    updateByIntercept:\n      enable: true\n    createAtIntercept:\n      enable: true\n    updateAtIntercept:\n      enable: true\n\n# springdoc\nspringdoc:\n  group-configs:\n   - group: web\n     packages-to-scan: com.startdis.iam.web\n   - group: app\n     packages-to-scan: com.startdis.iam.app\n\n# 开启系统操作日志\nsdt-log:\n  record:\n    enabled: true\n    appName: iam-web\n    pushUrl: http://192.168.31.18:1010/logRecord/add', '6c501aefa9e706da23a88c509785af42', '2024-08-30 00:03:15', '2024-08-30 00:03:14', NULL, '192.168.31.18', 'I', 'dev', '');
INSERT INTO `his_config_info` VALUES (86, 279, 'sdt-cloud-dev.yaml', 'dev', 'cloud', '# 服务端口号\nserver:\n  # tomcat 配置\n  tomcat:\n    # tomcat的URI编码\n    uri-encoding: UTF-8\n    # tomcat最大线程数，默认为200\n    max-threads: 500\n    # Tomcat启动初始化的线程数，默认值25\n    min-spare-threads: 30\n\nspring:\n    # 循环依赖的问题\n  main:\n    allow-circular-references: true\n  # MVC默认的路径匹配策略为PATH_PATTERN_PARSER，需要修改为ANT_PATH_MATCHER 解决swagger兼容性问题\n  mvc:\n    pathmatch:\n      matching-strategy: ANT_PATH_MATCHER\n\n# mybatis-plus\nmybatis-plus:\n  configuration:\n    #控制台打印完整带参数SQL语句\n    log-impl: org.apache.ibatis.logging.stdout.StdOutImpl\n  #mapper映射文件路径\n  mapper-locations: classpath*:/*-infra/src/main/resources/mapper/*.xml, classpath*:/mapper/**.xml\n\n#pagehelper\npagehelper:\n  # helper-dialect: mysql\n  #分页插件会自动检测当前的数据库链接，自动选择合适的分页方式。 你可以配置helperDialect 属性来指定分页插件使用哪种方言。\n  auto-runtime-dialect: true\n  #分页合理化参数，默认值为 false 。当该参数设置为 true 时， pageNum<=0 时会查询第一页， pageNum>pages （超过总数时），会查询最后一页。\n  reasonable: true\n  #支持通过Mapper接口参数传递page参数,默认值为false\n  support-methods-arguments: true\n  #默认值为 false ，当该参数设置为 true 时，如果 pageSize=0 或者 RowBounds.limit =0 就会查询出全部的结果（相当于没有执行分页查询，但是返回结果仍然是 Page 类型）。\n  page-size-zero: true\n  #为了支持 startPage(Object params) 方法，增加了该参数来配置参数映射，用于从对象中根据属性名取值\n  params: count=countSql\n  \n# feign\nfeign:\n  okhttp:\n    enabled: true\n  hystrix:\n    enabled: true\n  sentinel:\n    enabled: true\n  client:\n    config:\n      default:\n        connectTimeout: 100000\n        readTimeout: 100000\n\n# 定义日志输出级别\nlogging:\n  level:\n    com.startdis: debug\n    # spring 包日志输出级别\n    org.springframework: info\n    # alibaba 包日志输出级别\n    com.alibaba.cloud: info\n    # nacos 心跳 INFO 屏蔽\n    com.alibaba.nacos: off\n    # undertow\n    io.undertow: info\n    # mybatis-plus\n    com.baomidou.mybatisplus: debug\n\n# 日志输出路径配置\nlogback:\n  logDir: D:\\Logs\\sdt\\cloud\\${spring.application.name}\\', 'f5915e13333bb9171c954141c33a335d', '2024-08-30 00:03:19', '2024-08-30 00:03:19', 'nacos', '192.168.31.18', 'D', 'dev', '');
